trsuperobject.biblemap.put("b20_5_15", new trsuperobject(20,5,15,"Suyu kendi sarnıcından,Kendi kuyunun kaynağından iç."));
trsuperobject.biblemap.put("b20_5_16", new trsuperobject(20,5,16,"Pınarların sokakları,Akarsuların meydanları mı sulamalı?"));
trsuperobject.biblemap.put("b20_5_17", new trsuperobject(20,5,17,"Yalnız senin olsun onlar,Paylaşma yabancılarla."));
trsuperobject.biblemap.put("b20_5_18", new trsuperobject(20,5,18,"Çeşmen bereketli olsunVe gençken evlendiğin karınla mutlu ol."));
trsuperobject.biblemap.put("b20_5_19", new trsuperobject(20,5,19,"Sevimli bir geyik, zarif bir ceylan gibi,Hep seni doyursun memeleri.Aşkıyla sürekli coş."));
trsuperobject.biblemap.put("b20_5_20", new trsuperobject(20,5,20,"Oğlum, neden ahlaksız bir kadınla coşasın,Neden başka birinin karısını koynuna alasın?"));
trsuperobject.biblemap.put("b20_5_21", new trsuperobject(20,5,21,"RAB insanın tuttuğu yolu gözler,Attığı her adımı denetler."));
trsuperobject.biblemap.put("b20_5_22", new trsuperobject(20,5,22,"Kötü kişiyi kendi suçları ele verecek,Günahının kemendi kıskıvrak bağlayacak onu."));
trsuperobject.biblemap.put("b20_5_23", new trsuperobject(20,5,23,"Aşırı ahmaklığı onu yoldan çıkaracak,Terbiyeyi umursamadığı için ölecek."));
trsuperobject.biblemap.put("b20_6_1", new trsuperobject(20,6,1,"Oğlum, eğer birine kefil oldunsa,Onun borcunu yüklendinse,"));
trsuperobject.biblemap.put("b20_6_2", new trsuperobject(20,6,2,"Düştünse tuzağa kendi sözlerinle,Ağzının sözleriyle yakalandınsa,"));
trsuperobject.biblemap.put("b20_6_3", new trsuperobject(20,6,3,"O kişinin eline düştün demektir.Oğlum, şunu yap ve kendini kurtar:Git, yere kapan onun önünde,Ona yalvar yakar."));
trsuperobject.biblemap.put("b20_6_4", new trsuperobject(20,6,4,"Gözlerine uyku girmesin,Ağırlaşmasın göz kapakların."));
trsuperobject.biblemap.put("b20_6_5", new trsuperobject(20,6,5,"Avcının elinden ceylan gibi,Kuşbazın elinden kuş gibi kurtar kendini."));
trsuperobject.biblemap.put("b20_6_6", new trsuperobject(20,6,6,"Ey tembel kişi, git, karıncalara bak,Onların yaşamından bilgelik öğren."));
trsuperobject.biblemap.put("b20_6_7", new trsuperobject(20,6,7,"Başkanları, önderleri ya da yöneticileri olmadığı halde,"));
trsuperobject.biblemap.put("b20_6_8", new trsuperobject(20,6,8,"Yazın erzaklarını biriktirirler,Yiyeceklerini toplarlar biçim mevsiminde."));
trsuperobject.biblemap.put("b20_6_9", new trsuperobject(20,6,9,"Ne zamana dek yatacaksın, ey tembel kişi?Ne zaman kalkacaksın uykundan?"));
trsuperobject.biblemap.put("b20_6_10", new trsuperobject(20,6,10,"‹‹Biraz kestireyim, biraz uyuklayayım,Ellerimi kavuşturup şöyle bir uyuyayım›› demeye kalmadan,"));
trsuperobject.biblemap.put("b20_6_11", new trsuperobject(20,6,11,"Yokluk bir haydut gibi,Yoksulluk bir akıncı gibi gelir üzerine."));
trsuperobject.biblemap.put("b20_6_12", new trsuperobject(20,6,12,"Ağzında yalanla dolaşan kişi,Soysuz ve fesatçıdır."));
trsuperobject.biblemap.put("b20_6_13", new trsuperobject(20,6,13,"Göz kırpar, bir sürü ayak oyunu,El kol hareketleri yapar,"));
trsuperobject.biblemap.put("b20_6_14", new trsuperobject(20,6,14,"Ahlaksız yüreğinde kötülük tasarlar,Çekişmeler yaratır durmadan."));
trsuperobject.biblemap.put("b20_6_15", new trsuperobject(20,6,15,"Bu yüzden ansızın yıkıma uğrayacak,Birdenbire çaresizce yok olacak."));
trsuperobject.biblemap.put("b20_6_16", new trsuperobject(20,6,16,"RABbin nefret ettiği altı şey,İğrendiği yedi şey vardır:"));
trsuperobject.biblemap.put("b20_6_17", new trsuperobject(20,6,17,"Gururlu gözler,Yalancı dil,Suçsuz kanı döken eller,"));
trsuperobject.biblemap.put("b20_6_18", new trsuperobject(20,6,18,"Düzenbaz yürek,Kötülüğe seğirten ayaklar,"));
trsuperobject.biblemap.put("b20_6_19", new trsuperobject(20,6,19,"Yalan soluyan yalancı tanıkVe kardeşler arasında çekişme yaratan kişi."));
trsuperobject.biblemap.put("b20_6_20", new trsuperobject(20,6,20,"Oğlum, babanın buyruklarına uy,Annenin öğrettiklerinden ayrılma."));
trsuperobject.biblemap.put("b20_6_21", new trsuperobject(20,6,21,"Bunlar sürekli yüreğinin bağı olsun,Tak onları boynuna."));
trsuperobject.biblemap.put("b20_6_22", new trsuperobject(20,6,22,"Yolunda sana rehber olacak,Seni koruyacaklar yattığın zaman;Söyleşecekler seninle uyandığında."));
trsuperobject.biblemap.put("b20_6_23", new trsuperobject(20,6,23,"Bu buyruklar sana çıra,Öğretilenler ışıktır.Eğitici uyarılar yaşam yolunu gösterir."));
trsuperobject.biblemap.put("b20_6_24", new trsuperobject(20,6,24,"Seni kötü kadından,Başka birinin karısının yaltaklanan dilindenKoruyacak olan bunlardır."));
trsuperobject.biblemap.put("b20_6_25", new trsuperobject(20,6,25,"Böyle kadınların güzelliği seni ayartmasın,Bakışları seni tutsak etmesin."));
trsuperobject.biblemap.put("b20_6_26", new trsuperobject(20,6,26,"Çünkü fahişe yüzünden insan bir lokma ekmeğe muhtaç kalır,Başkasının karısıyla yatmak da kişinin canına mal olur. kalır›› ya da ‹‹Çünkü fahişenin ücreti ancak bir somun ekmektir››."));
trsuperobject.biblemap.put("b20_6_27", new trsuperobject(20,6,27,"İnsan koynuna ateş alır da,Giysisi yanmaz mı?"));
trsuperobject.biblemap.put("b20_6_28", new trsuperobject(20,6,28,"Korlar üzerinde yürür de,Ayakları kavrulmaz mı?"));
trsuperobject.biblemap.put("b20_6_29", new trsuperobject(20,6,29,"Başkasının karısıyla yatan adamın durumu budur.Böyle bir ilişkiye giren cezasız kalmaz."));
trsuperobject.biblemap.put("b20_6_30", new trsuperobject(20,6,30,"Aç hırsız karnını doyurmak için çalıyorsa,Kimse onu hor görmez."));
trsuperobject.biblemap.put("b20_6_31", new trsuperobject(20,6,31,"Ama yakalanırsa, çaldığının yedi katını ödemek zorunda;Varını yoğunu vermek anlamına gelse bile."));
trsuperobject.biblemap.put("b20_6_32", new trsuperobject(20,6,32,"Zina eden adam sağduyudan yoksundur.Yaptıklarıyla kendini yok eder."));
trsuperobject.biblemap.put("b20_6_33", new trsuperobject(20,6,33,"Payına düşen dayak ve onursuzluktur,Asla kurtulamaz utançtan."));
trsuperobject.biblemap.put("b20_6_34", new trsuperobject(20,6,34,"Çünkü kıskançlık kocanın öfkesini azdırır,Öç alırken acımasız olur."));
trsuperobject.biblemap.put("b20_6_35", new trsuperobject(20,6,35,"Hiçbir fidye kabul etmez,Gönlünü alamazsın armağanların çokluğuyla."));
trsuperobject.biblemap.put("b20_7_1", new trsuperobject(20,7,1,"Oğlum, sözlerimi yerine getir,Aklında tut buyruklarımı."));
trsuperobject.biblemap.put("b20_7_2", new trsuperobject(20,7,2,"Buyruklarımı yerine getir ki, yaşayasın.Öğrettiklerimi gözünün bebeği gibi koru."));
trsuperobject.biblemap.put("b20_7_3", new trsuperobject(20,7,3,"Onları yüzük gibi parmaklarına geçir,Yüreğinin levhasına yaz."));
trsuperobject.biblemap.put("b20_7_4", new trsuperobject(20,7,4,"Bilgeliğe, ‹‹Sen kızkardeşimsin››,Akla, ‹‹Akrabamsın›› de."));
trsuperobject.biblemap.put("b20_7_5", new trsuperobject(20,7,5,"Zina eden kadından,Yaltaklanan ahlaksız kadından seni koruyacak olan bunlardır."));
trsuperobject.biblemap.put("b20_7_6", new trsuperobject(20,7,6,"Evimin penceresinden,Kafesin ardından dışarıyı seyrederken,"));
trsuperobject.biblemap.put("b20_7_7", new trsuperobject(20,7,7,"Bir sürü toy gencin arasında,Sağduyudan yoksun bir delikanlı çarptı gözüme."));
trsuperobject.biblemap.put("b20_7_8-9", new trsuperobject(20,7,8-9,"Akşamüzeri, alaca karanlıkta,Akşam karanlığı çökerken,O kadının oturduğu sokağa saptığını,Onun evine yöneldiğini gördüm."));
trsuperobject.biblemap.put("b20_7_10", new trsuperobject(20,7,10,"Derken kadın onu karşıladı,Fahişe kılığıyla sinsice."));
trsuperobject.biblemap.put("b20_7_11", new trsuperobject(20,7,11,"Yaygaracı, dik başlı biriydi kadın.Bir an bile durmaz evde."));
trsuperobject.biblemap.put("b20_7_12", new trsuperobject(20,7,12,"Kâh sokakta, kâh meydanlardadır.Sokak başlarında pusuya yatar."));
trsuperobject.biblemap.put("b20_7_13", new trsuperobject(20,7,13,"Delikanlıyı tutup öptü,Yüzü kızarmadan ona şöyle dedi:"));
trsuperobject.biblemap.put("b20_7_14", new trsuperobject(20,7,14,"‹‹Esenlik kurbanlarımı kesmek zorundaydım,Adak sözümü bugün yerine getirdim."));
trsuperobject.biblemap.put("b20_7_15", new trsuperobject(20,7,15,"Bunun için seni karşılamaya, seni aramaya çıktım,İşte buldum seni!"));
trsuperobject.biblemap.put("b20_7_16", new trsuperobject(20,7,16,"Döşeğime Mısır ipliğinden dokunmuşRenkli örtüler serdim."));
trsuperobject.biblemap.put("b20_7_17", new trsuperobject(20,7,17,"Yatağıma mür, ödVe tarçın serptim."));
trsuperobject.biblemap.put("b20_7_18", new trsuperobject(20,7,18,"Haydi gel, sabaha dek doya doya sevişelim,Aşktan zevk alalım."));
trsuperobject.biblemap.put("b20_7_19", new trsuperobject(20,7,19,"Kocam evde değil,Uzun bir yolculuğa çıktı."));
trsuperobject.biblemap.put("b20_7_20", new trsuperobject(20,7,20,"Yanına para torbasını aldı,Dolunaydan önce eve dönmeyecek.››"));
trsuperobject.biblemap.put("b20_7_21", new trsuperobject(20,7,21,"Onu bir sürü çekici sözlerle baştan çıkardı,Tatlı diliyle peşinden sürükledi."));
trsuperobject.biblemap.put("b20_7_22", new trsuperobject(20,7,22,"Kesimevine götürülen öküz gibiHemen izledi onu delikanlı;Tuzağa düşen geyik gibi,"));
trsuperobject.biblemap.put("b20_7_23", new trsuperobject(20,7,23,"Ciğerini bir ok delene kadar;Kapana koşan bir kuş gibi,Bunun yaşamına mal olacağını bilmeden."));
trsuperobject.biblemap.put("b20_7_24", new trsuperobject(20,7,24,"Çocuklarım, şimdi dinleyin beni,Kulak verin söylediklerime,"));
trsuperobject.biblemap.put("b20_7_25", new trsuperobject(20,7,25,"Sakın o kadına gönül vermeyin,Onun yolundan gitmeyin."));
trsuperobject.biblemap.put("b20_7_26", new trsuperobject(20,7,26,"Yere serdiği bir sürü kurbanı var,Öldürdüğü kişilerin sayısı pek çok."));
trsuperobject.biblemap.put("b20_7_27", new trsuperobject(20,7,27,"Ölüler diyarına giden yoldur onun evi,Ölüm odalarına götürür."));
trsuperobject.biblemap.put("b20_8_1", new trsuperobject(20,8,1,"Bilgelik çağırıyor,Akıl sesini yükseltiyor."));
trsuperobject.biblemap.put("b20_8_2", new trsuperobject(20,8,2,"Yol kenarındaki tepelerin başında,Yolların birleştiği yerde duruyor o."));
trsuperobject.biblemap.put("b20_8_3", new trsuperobject(20,8,3,"Kentin girişinde, kapıların yanında,Sesini yükseltiyor:"));
trsuperobject.biblemap.put("b20_8_4", new trsuperobject(20,8,4,"‹‹Ey insanlar, size sesleniyorum,Çağrım insan soyunadır!"));
trsuperobject.biblemap.put("b20_8_5", new trsuperobject(20,8,5,"Ey bön kişiler, ihtiyatlı olmayı öğrenin;Sağduyulu olmayı öğrenin, ey akılsızlar!"));
trsuperobject.biblemap.put("b20_8_6", new trsuperobject(20,8,6,"Söylediğim yetkin sözleri dinleyin,Ağzımı doğruları söylemek için açarım."));
trsuperobject.biblemap.put("b20_8_7", new trsuperobject(20,8,7,"Ağzım gerçeği duyurur,Çünkü dudaklarım kötülükten iğrenir."));
trsuperobject.biblemap.put("b20_8_8", new trsuperobject(20,8,8,"Ağzımdan çıkan her söz doğrudur,Yoktur eğri ya da sapık olanı."));
trsuperobject.biblemap.put("b20_8_9", new trsuperobject(20,8,9,"Apaçıktır hepsi anlayana,Bilgiye erişen, doğruluğunu bilir onların."));
trsuperobject.biblemap.put("b20_8_10", new trsuperobject(20,8,10,"Gümüş yerine terbiyeyi,Saf altın yerine bilgiyi edinin."));
trsuperobject.biblemap.put("b20_8_11", new trsuperobject(20,8,11,"Çünkü bilgelik mücevherden değerlidir,Dilediğin hiçbir şey onunla kıyaslanamaz."));
trsuperobject.biblemap.put("b20_8_12", new trsuperobject(20,8,12,"Ben bilgelik olarak ihtiyatı kendime konut edindim.Bilgi ve sağgörü bendedir."));
trsuperobject.biblemap.put("b20_8_13", new trsuperobject(20,8,13,"RABden korkmak kötülükten nefret etmek demektir.Kibirden, küstahlıktan,Kötü yoldan, sapık ağızdan nefret ederim."));
trsuperobject.biblemap.put("b20_8_14", new trsuperobject(20,8,14,"Öğüt ve sağlam karar bana özgüdür.Akıl ve güç kaynağı benim."));
trsuperobject.biblemap.put("b20_8_15", new trsuperobject(20,8,15,"Krallar sayemde egemenlik sürer,Hükümdarlar adil kurallar koyar."));
trsuperobject.biblemap.put("b20_8_16", new trsuperobject(20,8,16,"Önderler, adaletle yöneten soylularSayemde yönetirler."));
trsuperobject.biblemap.put("b20_8_17", new trsuperobject(20,8,17,"Beni sevenleri ben de severim,Gayretle arayan beni bulur."));
trsuperobject.biblemap.put("b20_8_18", new trsuperobject(20,8,18,"Zenginlik ve onur,Kalıcı değerler ve bolluk bendedir."));
trsuperobject.biblemap.put("b20_8_19", new trsuperobject(20,8,19,"Meyvem altından, saf altından,Ürünüm seçme gümüşten daha iyidir."));
trsuperobject.biblemap.put("b20_8_20", new trsuperobject(20,8,20,"Doğruluk yolunda,Adaletin izinden yürürüm."));
trsuperobject.biblemap.put("b20_8_21", new trsuperobject(20,8,21,"Böylelikle, beni sevenleri servet sahibi yapar,Hazinelerini doldururum."));
trsuperobject.biblemap.put("b20_8_22", new trsuperobject(20,8,22,"RAB yaratma işine başladığındaİlk beni yarattı,"));
trsuperobject.biblemap.put("b20_8_23", new trsuperobject(20,8,23,"Dünya var olmadan önce,Ta başlangıçta, öncesizlikte yerimi aldım."));
trsuperobject.biblemap.put("b20_8_24", new trsuperobject(20,8,24,"Enginler yokken,Suları bol pınarlar yokken doğdum ben."));
trsuperobject.biblemap.put("b20_8_25-26", new trsuperobject(20,8,25-26,"Dağlar daha oluşmadan,Tepeler belirmeden,RAB dünyayı, kırlarıVe dünyadaki toprağın zerresini yaratmadan doğdum."));
trsuperobject.biblemap.put("b20_8_27", new trsuperobject(20,8,27,"RAB gökleri yerine koyduğunda oradaydım,Engin denizleri ufukla çevirdiğinde,"));
trsuperobject.biblemap.put("b20_8_28", new trsuperobject(20,8,28,"Bulutları oluşturduğunda,Denizin kaynaklarını güçlendirdiğinde,"));
trsuperobject.biblemap.put("b20_8_29", new trsuperobject(20,8,29,"Sular buyruğundan öte geçmesinler diyeDenize sınır çizdiğinde,Dünyanın temellerini pekiştirdiğinde,"));
trsuperobject.biblemap.put("b20_8_30", new trsuperobject(20,8,30,"Baş mimar olarak Onun yanındaydım.Gün be gün sevinçle dolup taştım,Huzurunda hep coştum."));
trsuperobject.biblemap.put("b20_8_31", new trsuperobject(20,8,31,"Onun dünyası mutluluğum,İnsanları sevincimdi."));
trsuperobject.biblemap.put("b20_8_32", new trsuperobject(20,8,32,"Çocuklarım, şimdi beni dinleyin:Yolumu izleyenlere ne mutlu!"));
trsuperobject.biblemap.put("b20_8_33", new trsuperobject(20,8,33,"Uyarılarımı dinleyin ve bilge kişiler olun,Görmezlikten gelmeyin onları."));
trsuperobject.biblemap.put("b20_8_34", new trsuperobject(20,8,34,"Beni dinleyen,Her gün kapımı gözleyen,Kapımın eşiğinden ayrılmayan kişiye ne mutlu!"));
trsuperobject.biblemap.put("b20_8_35", new trsuperobject(20,8,35,"Çünkü beni bulan yaşam bulurVe RABbin beğenisini kazanır."));
trsuperobject.biblemap.put("b20_8_36", new trsuperobject(20,8,36,"Beni gözardı edense kendine zarar verir,Benden nefret eden, ölümü seviyor demektir.››"));
trsuperobject.biblemap.put("b20_9_1", new trsuperobject(20,9,1,"Bilgelik kendi evini yaptı,Yedi direğini yonttu."));
trsuperobject.biblemap.put("b20_9_2", new trsuperobject(20,9,2,"Hayvanlarını kesti,Şarabını hazırlayıp sofrasını kurdu."));
trsuperobject.biblemap.put("b20_9_3", new trsuperobject(20,9,3,"Kentin en yüksek noktalarına gönderdiğiHizmetçileri aracılığıyla herkesi çağırıyor:"));
trsuperobject.biblemap.put("b20_9_4-5", new trsuperobject(20,9,4-5,"‹‹Kim safsa buraya gelsin›› diyor.Sağduyudan yoksun olanlara da,‹‹Gelin, yiyeceklerimi yiyin,Hazırladığım şaraptan için›› diyor."));
trsuperobject.biblemap.put("b20_9_6", new trsuperobject(20,9,6,"‹‹Saflığı bırakın da yaşayın,Aklın yolunu izleyin."));
trsuperobject.biblemap.put("b20_9_7", new trsuperobject(20,9,7,"‹‹Alaycıyı paylayan aşağılanmayı hak eder,Kötü kişiyi azarlayan hakarete uğrar."));
trsuperobject.biblemap.put("b20_9_8", new trsuperobject(20,9,8,"Alaycıyı azarlama, yoksa senden nefret eder.Bilge kişiyi azarlarsan, seni sever."));
trsuperobject.biblemap.put("b20_9_9", new trsuperobject(20,9,9,"Bilge kişiyi eğitirsenDaha bilge olur,Doğru kişiye öğretirsen bilgisini artırır."));
trsuperobject.biblemap.put("b20_9_10", new trsuperobject(20,9,10,"RAB korkusudur bilgeliğin temeli.Akıl Kutsal Olanı tanımaktır."));
trsuperobject.biblemap.put("b20_9_11", new trsuperobject(20,9,11,"Benim sayemde günlerin çoğalacak,Ömrüne yıllar katılacak."));
trsuperobject.biblemap.put("b20_9_12", new trsuperobject(20,9,12,"Bilgeysen, bilgeliğinin yararı sanadır,Alaycı olursan acısını yalnız sen çekersin.››"));
trsuperobject.biblemap.put("b20_9_13", new trsuperobject(20,9,13,"Akılsız kadın yaygaracıVe saftır, hiçbir şey bilmez."));
trsuperobject.biblemap.put("b20_9_14-15", new trsuperobject(20,9,14-15,"Evinin kapısında,Kentin en yüksek yerinde bir iskemleye oturur;Yoldan geçenleri,Kendi yollarından gidenleri çağırmak için,"));
trsuperobject.biblemap.put("b20_9_16", new trsuperobject(20,9,16,"‹‹Kim safsa buraya gelsin›› der.Sağduyudan yoksun olanlara da,"));
trsuperobject.biblemap.put("b20_9_17", new trsuperobject(20,9,17,"‹‹Çalıntı su tatlı,Gizlice yenen yemek lezzetlidir›› der."));
trsuperobject.biblemap.put("b20_9_18", new trsuperobject(20,9,18,"Ne var ki, evine girenler ölüme gittiklerini,Ona konuk olanlarÖlüler diyarının dibine indiklerini bilmezler."));
trsuperobject.biblemap.put("b20_10_1", new trsuperobject(20,10,1,"Süleymanın özdeyişleri:Bilge çocuk babasını sevindirir,Akılsız çocuk annesini üzer."));
trsuperobject.biblemap.put("b20_10_2", new trsuperobject(20,10,2,"Haksızca kazanılan servetin yararı yoktur,Ama doğruluk ölümden kurtarır."));
trsuperobject.biblemap.put("b20_10_4", new trsuperobject(20,10,4,"Tembel eller insanı yoksullaştırır,Çalışkan el zengin eder."));
trsuperobject.biblemap.put("b20_10_5", new trsuperobject(20,10,5,"Aklı başında evlat ürünü yazın toplar,Hasatta uyuyansa ailesinin yüzkarasıdır."));
trsuperobject.biblemap.put("b20_10_6", new trsuperobject(20,10,6,"Bereket doğru kişinin başına yağar,Kötülerse zorbalıklarını sözle gizler."));
trsuperobject.biblemap.put("b20_10_7", new trsuperobject(20,10,7,"Doğrular övgüyle,Kötüler nefretle anılır."));
trsuperobject.biblemap.put("b20_10_8", new trsuperobject(20,10,8,"Bilge kişi buyrukları kabul eder,Çenesi düşük ahmaksa yıkıma uğrar."));
trsuperobject.biblemap.put("b20_10_9", new trsuperobject(20,10,9,"Dürüst kişi güvenlik içinde yaşar,Ama hileli yoldan giden açığa vurulacaktır."));
trsuperobject.biblemap.put("b20_10_10", new trsuperobject(20,10,10,"Sinsice göz kırpan, acılara neden olur.Çenesi düşük ahmak da yıkıma uğrar. (bkz.10:8), Septuaginta ‹‹Cesaretle azarlayan esenlik sağlar››."));
trsuperobject.biblemap.put("b20_10_11", new trsuperobject(20,10,11,"Doğru kişinin ağzı yaşam pınarıdır,Kötülerse zorbalıklarını sözle gizlerler."));
trsuperobject.biblemap.put("b20_10_12", new trsuperobject(20,10,12,"Nefret çekişmeyi azdırır,Sevgi her suçu bağışlar."));
trsuperobject.biblemap.put("b20_10_13", new trsuperobject(20,10,13,"Akıllı kişinin dudaklarından bilgelik akar,Ama sağduyudan yoksun olan sırtına kötek yer."));
trsuperobject.biblemap.put("b20_10_14", new trsuperobject(20,10,14,"Bilge kişi bilgi biriktirir,Ahmağın ağzıysa onu yıkıma yaklaştırır."));
trsuperobject.biblemap.put("b20_10_15", new trsuperobject(20,10,15,"Zenginin serveti onun kalesidir,Fakirin yoksulluğu ise onu yıkıma götürür."));
trsuperobject.biblemap.put("b20_10_16", new trsuperobject(20,10,16,"Doğru kişinin ücreti yaşamdır,Kötünün geliriyse kendisine cezadır."));
trsuperobject.biblemap.put("b20_10_17", new trsuperobject(20,10,17,"Terbiyeye kulak veren yaşam yolunu bulur.Uyarıları reddedense başkalarını yoldan saptırır."));
trsuperobject.biblemap.put("b20_10_18", new trsuperobject(20,10,18,"Nefretini gizleyen kişinin dudakları yalancıdır.İftira yayan akılsızdır."));
trsuperobject.biblemap.put("b20_10_19", new trsuperobject(20,10,19,"Çok konuşanın günahı eksik olmaz,Sağduyulu kişiyse dilini tutar."));
trsuperobject.biblemap.put("b20_10_20", new trsuperobject(20,10,20,"Doğru kişinin dili saf gümüş gibidir,Kötünün niyetleriyse değersizdir."));
trsuperobject.biblemap.put("b20_10_21", new trsuperobject(20,10,21,"Doğru kişinin sözleri birçoklarını besler,Ahmaklarsa sağduyu yoksunluğundan ölür."));
trsuperobject.biblemap.put("b20_10_22", new trsuperobject(20,10,22,"RABbin bereketidir kişiyi zengin eden,RAB buna dert katmaz."));
trsuperobject.biblemap.put("b20_10_23", new trsuperobject(20,10,23,"Kötülük akılsızlar için eğlence gibidir.Aklı başında olanlar içinse bilgelik aynı şeydir."));
trsuperobject.biblemap.put("b20_10_24", new trsuperobject(20,10,24,"Kötü kişinin korktuğu başına gelir,Doğru kişiyse dileğine erişir."));
trsuperobject.biblemap.put("b20_10_25", new trsuperobject(20,10,25,"Kasırga gelince kötü kişiyi silip götürür;Ama doğru kişi sonsuza dek ayakta kalır."));
trsuperobject.biblemap.put("b20_10_26", new trsuperobject(20,10,26,"Dişler için sirke,Gözler için duman neyse,Tembel ulak da kendisini gönderen için öyledir."));
trsuperobject.biblemap.put("b20_10_27", new trsuperobject(20,10,27,"RAB korkusu ömrü uzatır,Kötülerin yıllarıysa kısadır."));
trsuperobject.biblemap.put("b20_10_28", new trsuperobject(20,10,28,"Doğrunun umudu onu sevindirir,Kötünün beklentileriyse boşa çıkar."));
trsuperobject.biblemap.put("b20_10_29", new trsuperobject(20,10,29,"RABbin yolu dürüst için sığınak,Fesatçı içinse yıkımdır."));
trsuperobject.biblemap.put("b20_10_30", new trsuperobject(20,10,30,"Doğru kişi hiçbir zaman sarsılmaz,Ama kötüler ülkede kalamaz."));
trsuperobject.biblemap.put("b20_10_31", new trsuperobject(20,10,31,"Doğru kişinin ağzı bilgelik üretir,Sapık dilse kesilir."));
trsuperobject.biblemap.put("b20_10_32", new trsuperobject(20,10,32,"Doğru kişinin dudakları söylenecek sözü bilir,Kötünün ağzındansa sapık sözler çıkar."));
trsuperobject.biblemap.put("b20_11_2", new trsuperobject(20,11,2,"Küstahlığın ardından utanç gelir,Ama bilgelik alçakgönüllülerdedir."));
trsuperobject.biblemap.put("b20_11_3", new trsuperobject(20,11,3,"Erdemlinin dürüstlüğü ona yol gösterir,Hainin yalancılığıysa yıkıma götürür."));
trsuperobject.biblemap.put("b20_11_4", new trsuperobject(20,11,4,"Gazap günü servet işe yaramaz,Oysa doğruluk ölümden kurtarır."));
trsuperobject.biblemap.put("b20_11_5", new trsuperobject(20,11,5,"Dürüst insanın doğruluğu onun yolunu düzler,Kötü kişiyse kötülüğü yüzünden yıkılıp düşer."));
trsuperobject.biblemap.put("b20_11_6", new trsuperobject(20,11,6,"Erdemlinin doğruluğu onu kurtarır,Ama haini kendi hırsı ele verir."));
trsuperobject.biblemap.put("b20_11_7", new trsuperobject(20,11,7,"Kötü kişi öldüğünde umutları yok olur,Güvendiği güç de biter."));
trsuperobject.biblemap.put("b20_11_8", new trsuperobject(20,11,8,"Doğru kişi sıkıntıdan kurtulur,Onun yerine sıkıntıyı kötü kişi çeker."));
trsuperobject.biblemap.put("b20_11_9", new trsuperobject(20,11,9,"Tanrısız kişi başkalarını ağzıyla yıkıma götürür,Oysa doğrular bilgi sayesinde kurtulur."));
trsuperobject.biblemap.put("b20_11_10", new trsuperobject(20,11,10,"Doğruların başarısına kent bayram eder,Kötülerin ölümüne sevinç çığlıkları atılır."));
trsuperobject.biblemap.put("b20_11_11", new trsuperobject(20,11,11,"Dürüstlerin kutsamasıyla kent gelişir,Ama kötülerin ağzı kenti yerle bir eder."));
trsuperobject.biblemap.put("b20_11_12", new trsuperobject(20,11,12,"Başkasını küçük gören sağduyudan yoksundur,Akıllı kişiyse dilini tutar."));
trsuperobject.biblemap.put("b20_11_13", new trsuperobject(20,11,13,"Dedikoducu sır saklayamaz,Oysa güvenilir insan sırdaş olur."));
trsuperobject.biblemap.put("b20_11_14", new trsuperobject(20,11,14,"Yol göstereni olmayan ulus düşer,Danışmanı bol olan zafere gider."));
trsuperobject.biblemap.put("b20_11_15", new trsuperobject(20,11,15,"Yabancıya kefil olan mutlaka zarar görür,Kefaletten kaçınan güvenlik içinde yaşar."));
trsuperobject.biblemap.put("b20_11_16", new trsuperobject(20,11,16,"Sevecen kadın onurfç,Zorbalarsa yalnızca servet kazanır. geçiyor: ‹‹Ama doğruluktan nefret eden kadın onursuzluk tahtıdır. Tembeller servetten yoksun olur.››"));
trsuperobject.biblemap.put("b20_11_17", new trsuperobject(20,11,17,"İyilikseverin yararı kendinedir,Gaddarsa kendi başına bela getirir."));
trsuperobject.biblemap.put("b20_11_18", new trsuperobject(20,11,18,"Kötü kişinin kazancı aldatıcıdır,Doğruluk ekenin ödülüyse güvenlidir."));
trsuperobject.biblemap.put("b20_11_19", new trsuperobject(20,11,19,"Yürekten doğru olan yaşama kavuşur,Kötülüğün ardından giden ölümünü hazırlar."));
trsuperobject.biblemap.put("b20_11_20", new trsuperobject(20,11,20,"RAB sapık yürekliden iğrenir,Dürüst yaşayandan hoşnut kalır."));
trsuperobject.biblemap.put("b20_11_21", new trsuperobject(20,11,21,"Bilin ki, kötü kişi cezasız kalmaz,Doğruların soyuysa kurtulur."));
trsuperobject.biblemap.put("b20_11_22", new trsuperobject(20,11,22,"Sağduyudan yoksun kadının güzelliği,Domuzun burnundaki altın halkaya benzer."));
trsuperobject.biblemap.put("b20_11_23", new trsuperobject(20,11,23,"Doğruların isteği hep iyilikle sonuçlanır,Kötülerin umutlarıysa gazapla."));
trsuperobject.biblemap.put("b20_11_24", new trsuperobject(20,11,24,"Eliaçık olan daha çok kazanır,Hak yiyenin sonuysa yoksulluktur."));
trsuperobject.biblemap.put("b20_11_25", new trsuperobject(20,11,25,"Cömert olan bolluğa erecek,Başkasına su verene su verilecek."));
trsuperobject.biblemap.put("b20_11_26", new trsuperobject(20,11,26,"Halk buğday istifleyeni lanetler,Ama buğday satanı kutsar."));
trsuperobject.biblemap.put("b20_11_27", new trsuperobject(20,11,27,"İyiliği amaç edinen beğeni kazanır,Kötülüğü amaç edinense kötülüğe uğrar."));
trsuperobject.biblemap.put("b20_11_28", new trsuperobject(20,11,28,"Zenginliğine güvenen tepetaklak gidecek,Oysa doğrular dalındaki yaprak gibi gelişecek."));
trsuperobject.biblemap.put("b20_11_29", new trsuperobject(20,11,29,"Ailesine sıkıntı çektirenin mirası yeldir,Ahmaklar da bilgelerin kulu olur."));
trsuperobject.biblemap.put("b20_11_30", new trsuperobject(20,11,30,"Doğru kişinin işleri yaşam ağacının meyvesine benzer,Bilge kişi insanları kazanır."));
trsuperobject.biblemap.put("b20_11_31", new trsuperobject(20,11,31,"Bu dünyada doğru kişi bile cezalandırılırsa,Kötülerle günahlıların cezalandırılacağı kesindir."));
trsuperobject.biblemap.put("b20_12_1", new trsuperobject(20,12,1,"Terbiye edilmeyi seven bilgiyi de sever,Azarlanmaktan nefret eden budaladır."));
trsuperobject.biblemap.put("b20_12_2", new trsuperobject(20,12,2,"İyi kişi RABbin lütfuna erer,Ama düzenbazı RAB mahkûm eder."));
trsuperobject.biblemap.put("b20_12_3", new trsuperobject(20,12,3,"Kötülük kişiyi güvenliğe kavuşturmaz,Ama doğruların kökü kazılamaz."));
trsuperobject.biblemap.put("b20_12_4", new trsuperobject(20,12,4,"Erdemli kadın kocasının tacıdır,Edepsiz kadınsa kocasını yer bitirir."));
trsuperobject.biblemap.put("b20_12_5", new trsuperobject(20,12,5,"Doğruların tasarıları adil,Kötülerin öğütleri aldatıcıdır."));
trsuperobject.biblemap.put("b20_12_6", new trsuperobject(20,12,6,"Kötülerin sözleri ölüm tuzağıdır,Doğruların konuşmasıysa onları kurtarır."));
trsuperobject.biblemap.put("b20_12_7", new trsuperobject(20,12,7,"Kötüler yıkılıp yok olur,Doğru kişinin evi ayakta kalır."));
trsuperobject.biblemap.put("b20_12_8", new trsuperobject(20,12,8,"Kişi sağduyusu oranında övülür,Çarpık düşünceliyse küçümsenir."));
trsuperobject.biblemap.put("b20_12_9", new trsuperobject(20,12,9,"Köle sahibi olup aşağılananBüyüklük taslayıp ekmeğe muhtaç olandan yeğdir."));
trsuperobject.biblemap.put("b20_12_10", new trsuperobject(20,12,10,"Doğru kişi hayvanıyla ilgilenir,Ama kötünün sevecenliği bile zalimcedir."));
trsuperobject.biblemap.put("b20_12_11", new trsuperobject(20,12,11,"Toprağını işleyenin ekmeği bol olur,Hayal peşinde koşansa sağduyudan yoksundur."));
trsuperobject.biblemap.put("b20_12_12", new trsuperobject(20,12,12,"Kötü kişi kötülerin ganimetini ister,Ama doğru kişilerin kökü ürün verir."));
trsuperobject.biblemap.put("b20_12_13", new trsuperobject(20,12,13,"Kötü kişinin günahlı sözleri kendisi için tuzaktır,Ama doğru kişi sıkıntıyı atlatır."));
trsuperobject.biblemap.put("b20_12_14", new trsuperobject(20,12,14,"İnsan ağzının ürünüyle iyiliğe doyar,Elinin emeğine göre de karşılığını alır."));
trsuperobject.biblemap.put("b20_12_15", new trsuperobject(20,12,15,"Ahmağın yolu kendi gözünde doğrudur,Bilge kişiyse öğüde kulak verir."));
trsuperobject.biblemap.put("b20_12_16", new trsuperobject(20,12,16,"Ahmak sinirlendiğini hemen belli eder,Ama ihtiyatlı olan aşağılanmaya aldırmaz."));
trsuperobject.biblemap.put("b20_12_17", new trsuperobject(20,12,17,"Dürüst tanık doğruyu söyler,Yalancı tanıksa hile solur."));
trsuperobject.biblemap.put("b20_12_18", new trsuperobject(20,12,18,"Düşünmeden söylenen sözler kılıç gibi keser,Bilgelerin diliyse şifa verir."));
trsuperobject.biblemap.put("b20_12_19", new trsuperobject(20,12,19,"Gerçek sözler sonsuza dek kalıcıdır,Oysa yalanın ömrü bir anlıktır."));
trsuperobject.biblemap.put("b20_12_20", new trsuperobject(20,12,20,"Kötülük tasarlayanın yüreği hileci,Barışı öğütleyenin yüreğiyse sevinçlidir."));
trsuperobject.biblemap.put("b20_12_21", new trsuperobject(20,12,21,"Doğru kişiye hiç zarar gelmez,Kötünün başıysa beladan kurtulmaz."));
trsuperobject.biblemap.put("b20_12_22", new trsuperobject(20,12,22,"RAB yalancı dudaklardan iğrenir,Ama gerçeğe uyanlardan hoşnut kalır."));
trsuperobject.biblemap.put("b20_12_23", new trsuperobject(20,12,23,"İhtiyatlı kişi bilgisini kendine saklar,Oysa akılsızın yüreği ahmaklığını ilan eder."));
trsuperobject.biblemap.put("b20_12_24", new trsuperobject(20,12,24,"Çalışkanların eli egemenlik sürer,Tembellikse köleliğe götürür."));
trsuperobject.biblemap.put("b20_12_25", new trsuperobject(20,12,25,"Kaygılı yürek insanı çökertir,Ama güzel söz sevindirir."));
trsuperobject.biblemap.put("b20_12_26", new trsuperobject(20,12,26,"Doğru kişi arkadaşına da yol gösterir,Kötünün tuttuğu yolsa kendini saptırır."));
trsuperobject.biblemap.put("b20_12_27", new trsuperobject(20,12,27,"Tembel kişi işini bitirmez,Oysa çalışkan değerli bir servet kazanır."));
trsuperobject.biblemap.put("b20_12_28", new trsuperobject(20,12,28,"Doğru yol yaşam kaynağıdır,Bu yol ölümsüzlüğe götürür."));
trsuperobject.biblemap.put("b20_13_1", new trsuperobject(20,13,1,"Bilge kişi terbiye edilmeyi sever,Alaycı kişi azarlansa da aldırmaz."));
trsuperobject.biblemap.put("b20_13_2", new trsuperobject(20,13,2,"İyi insan ağzından çıkan sözler için ödüllendirilir,Ama hainlerin soluduğu zorbalıktır."));
trsuperobject.biblemap.put("b20_13_3", new trsuperobject(20,13,3,"Dilini tutan canını korur,Ama boşboğazın sonu yıkımdır."));
trsuperobject.biblemap.put("b20_13_4", new trsuperobject(20,13,4,"Tembel canının çektiğini elde edemez,Çalışkanın istekleriyse tümüyle yerine gelir."));
trsuperobject.biblemap.put("b20_13_5", new trsuperobject(20,13,5,"Doğru kişi yalandan nefret eder,Kötünün sözleriyse iğrençtir, yüzkarasıdır."));
trsuperobject.biblemap.put("b20_13_6", new trsuperobject(20,13,6,"Doğruluk dürüst yaşayanı korur,Kötülük günahkârı yıkar."));
trsuperobject.biblemap.put("b20_13_7", new trsuperobject(20,13,7,"Kimi hiçbir şeyi yokken kendini zengin gösterir,Kimi serveti çokken kendini yoksul gösterir."));
trsuperobject.biblemap.put("b20_13_8", new trsuperobject(20,13,8,"Kişinin serveti gün gelir canına fidye olur,Oysa yoksul kişi tehdide aldırmaz."));
trsuperobject.biblemap.put("b20_13_9", new trsuperobject(20,13,9,"Doğruların ışığı parlak yanar,Kötülerin çırası söner."));
trsuperobject.biblemap.put("b20_13_10", new trsuperobject(20,13,10,"Kibirden ancak kavga çıkar,Öğüt dinleyense bilgedir."));
trsuperobject.biblemap.put("b20_13_11", new trsuperobject(20,13,11,"Havadan kazanılan para yok olur,Azar azar biriktirenin serveti çok olur."));
trsuperobject.biblemap.put("b20_13_12", new trsuperobject(20,13,12,"Ertelenen umut hayal kırıklığına uğratır,Yerine gelen dilekse yaşam verir."));
trsuperobject.biblemap.put("b20_13_13", new trsuperobject(20,13,13,"Uyarılara kulak asmayan bedelini öder,Buyruklara saygılı olansa ödülünü alır."));
trsuperobject.biblemap.put("b20_13_14", new trsuperobject(20,13,14,"Bilgelerin öğrettikleri yaşam kaynağıdır,İnsanı ölüm tuzaklarından uzaklaştırır."));
trsuperobject.biblemap.put("b20_13_15", new trsuperobject(20,13,15,"Sağduyulu davranış saygınlık kazandırır,Hainlerin yoluysa yıkıma götürür. Masoretik metin ‹‹Sürer›› ya da ‹‹Çetindir››."));
trsuperobject.biblemap.put("b20_13_16", new trsuperobject(20,13,16,"İhtiyatlı kişi işini bilerek yapar,Akılsız kişiyse ahmaklığını sergiler."));
trsuperobject.biblemap.put("b20_13_17", new trsuperobject(20,13,17,"Kötü ulak belaya düşer,Güvenilir elçiyse şifa getirir."));
trsuperobject.biblemap.put("b20_13_18", new trsuperobject(20,13,18,"Terbiye edilmeye yanaşmayanıYokluk ve utanç bekliyor,Ama azara kulak veren onurlandırılır."));
trsuperobject.biblemap.put("b20_13_19", new trsuperobject(20,13,19,"Yerine getirilen dilek mutluluk verir.Akılsız kötülükten uzak kalamaz."));
trsuperobject.biblemap.put("b20_13_20", new trsuperobject(20,13,20,"Bilgelerle oturup kalkan bilge olur,Akılsızlarla dost olansa zarar görür."));
trsuperobject.biblemap.put("b20_13_21", new trsuperobject(20,13,21,"Günahkârın peşini felaket bırakmaz,Doğruların ödülüyse gönençtir."));
trsuperobject.biblemap.put("b20_13_22", new trsuperobject(20,13,22,"İyi kişi torunlarına miras bırakır,Günahkârın servetiyse doğru kişiye kalır."));
trsuperobject.biblemap.put("b20_13_23", new trsuperobject(20,13,23,"Yoksulun tarlası bol ürün verebilir,Ama haksızlık bunu alıp götürür."));
trsuperobject.biblemap.put("b20_13_24", new trsuperobject(20,13,24,"Oğlundan değneği esirgeyen, onu sevmiyor demektir.Seven baba özenle terbiye eder."));
trsuperobject.biblemap.put("b20_13_25", new trsuperobject(20,13,25,"Doğru kişinin yeterince yiyeceği vardır,Kötünün karnıysa aç kalır."));
trsuperobject.biblemap.put("b20_14_1", new trsuperobject(20,14,1,"Bilge kadın evini yapar,Ahmak kadın evini kendi eliyle yıkar."));
trsuperobject.biblemap.put("b20_14_2", new trsuperobject(20,14,2,"Doğru yolda yürüyen, RABden korkar,Yoldan sapan, RABbi hor görür."));
trsuperobject.biblemap.put("b20_14_3", new trsuperobject(20,14,3,"Ahmağın sözleri sırtına kötektir,Ama bilgenin dudakları kendisini korur."));
trsuperobject.biblemap.put("b20_14_4", new trsuperobject(20,14,4,"Öküz yoksa yemlik boş kalır,Çünkü bol ürünü sağlayan öküzün gücüdür."));
trsuperobject.biblemap.put("b20_14_5", new trsuperobject(20,14,5,"Güvenilir tanık yalan söylemez,Yalancı tanıksa yalan solur."));
trsuperobject.biblemap.put("b20_14_6", new trsuperobject(20,14,6,"Alaycı bilgeliği arasa da bulamaz,Akıllı içinse bilgi edinmek kolaydır."));
trsuperobject.biblemap.put("b20_14_7", new trsuperobject(20,14,7,"Akılsız kişiden uzak dur,Çünkü sana öğretecek bir şeyi yok."));
trsuperobject.biblemap.put("b20_14_8", new trsuperobject(20,14,8,"İhtiyatlı kişinin bilgeliği, ne yapacağını bilmektir,Akılsızların ahmaklığıysa aldanmaktır."));
trsuperobject.biblemap.put("b20_14_9", new trsuperobject(20,14,9,"Ahmaklar suç sunusuyla alay eder,Dürüstler ise iyi niyetlidir."));
trsuperobject.biblemap.put("b20_14_10", new trsuperobject(20,14,10,"Yürek kendi acısını bilir,Sevinciniyse kimse paylaşmaz."));
trsuperobject.biblemap.put("b20_14_11", new trsuperobject(20,14,11,"Kötü kişinin evi yerle bir edilecek,Doğru kişinin konutuysa bayındır olacak."));
trsuperobject.biblemap.put("b20_14_12", new trsuperobject(20,14,12,"Öyle yol var ki, insana düz gibi görünür,Ama sonu ölümdür."));
trsuperobject.biblemap.put("b20_14_13", new trsuperobject(20,14,13,"Gülerken bile yürek sızlayabilir,Sevinç bitince acı yine görünebilir."));
trsuperobject.biblemap.put("b20_14_14", new trsuperobject(20,14,14,"Yüreği dönek olan tuttuğu yolun,İyi kişi de yaptıklarının ödülünü alacaktır."));
trsuperobject.biblemap.put("b20_14_15", new trsuperobject(20,14,15,"Saf kişi her söze inanır,İhtiyatlı olansa attığı her adımı hesaplar."));
trsuperobject.biblemap.put("b20_14_16", new trsuperobject(20,14,16,"Bilge kişi korktuğu için kötülükten uzaklaşır,Akılsızsa büyüklük taslayıp kendine güvenir."));
trsuperobject.biblemap.put("b20_14_17", new trsuperobject(20,14,17,"Çabuk öfkelenen ahmakça davranır,Düzenbazdan herkes nefret eder."));
trsuperobject.biblemap.put("b20_14_18", new trsuperobject(20,14,18,"Saf kişilerin mirası akılsızlıktır,İhtiyatlı kişilerin tacı ise bilgidir."));
trsuperobject.biblemap.put("b20_14_19", new trsuperobject(20,14,19,"Alçaklar iyilerin önünde,Kötüler doğruların kapısında eğilirler."));
trsuperobject.biblemap.put("b20_14_20", new trsuperobject(20,14,20,"Komşusu bile yoksulu sevmez,Oysa zenginin dostu çoktur."));
trsuperobject.biblemap.put("b20_14_21", new trsuperobject(20,14,21,"Komşuyu hor görmek günahtır,Ne mutlu mazluma lütfedene!"));
trsuperobject.biblemap.put("b20_14_22", new trsuperobject(20,14,22,"Kötülük tasarlayan yolunu şaşırmaz mı?Oysa iyilik tasarlayan sevgi ve sadakat kazanır."));
trsuperobject.biblemap.put("b20_14_23", new trsuperobject(20,14,23,"Her emek kazanç getirir,Ama boş lakırdı yoksulluğa götürür."));
trsuperobject.biblemap.put("b20_14_24", new trsuperobject(20,14,24,"Bilgelerin tacı servetleridir,Akılsızlarsa ahmaklıklarıyla tanınır. ‹‹Akılsızların çelengiyse ahmaklıktır››."));
trsuperobject.biblemap.put("b20_14_25", new trsuperobject(20,14,25,"Dürüst tanık can kurtarır,Yalancı tanık aldatıcıdır."));
trsuperobject.biblemap.put("b20_14_26", new trsuperobject(20,14,26,"RABden korkan tam güvenliktedir,RAB onun çocuklarına da sığınak olacaktır."));
trsuperobject.biblemap.put("b20_14_27", new trsuperobject(20,14,27,"RAB korkusu yaşam kaynağıdır,İnsanı ölüm tuzaklarından uzaklaştırır."));
trsuperobject.biblemap.put("b20_14_28", new trsuperobject(20,14,28,"Kralın yüceliği halkının çokluğuna bağlıdır,Halk yok olursa hükümdar da mahvolur."));
trsuperobject.biblemap.put("b20_14_29", new trsuperobject(20,14,29,"Geç öfkelenen akıllıdır,Çabuk sinirlenen ahmaklığını gösterir."));
trsuperobject.biblemap.put("b20_14_30", new trsuperobject(20,14,30,"Huzurlu yürek bedenin yaşam kaynağıdır,Hırs ise insanı için için yer bitirir."));
trsuperobject.biblemap.put("b20_14_31", new trsuperobject(20,14,31,"Muhtacı ezen, Yaradanını hor görüyor demektir.Yoksula acıyansa Yaradanı yüceltir."));
trsuperobject.biblemap.put("b20_14_32", new trsuperobject(20,14,32,"Kötü kişi uğradığı felaketle yıkılır,Doğru insanın ölümde bile sığınacak yeri var."));
trsuperobject.biblemap.put("b20_14_33", new trsuperobject(20,14,33,"Bilgelik akıllı kişinin yüreğinde barınır,Akılsızlar arasında bile kendini belli eder."));
trsuperobject.biblemap.put("b20_14_34", new trsuperobject(20,14,34,"Doğruluk bir ulusu yüceltir,Oysa günah herhangi bir halk için utançtır."));
trsuperobject.biblemap.put("b20_14_35", new trsuperobject(20,14,35,"Kral sağduyulu kulunu beğenir,Utanç getirene öfkelenir."));
trsuperobject.biblemap.put("b20_15_1", new trsuperobject(20,15,1,"Yumuşak yanıt gazabı yatıştırır,Oysa yaralayıcı söz öfkeyi alevlendirir."));
trsuperobject.biblemap.put("b20_15_2", new trsuperobject(20,15,2,"Bilgenin dili bilgiyi iyi kullanır,Akılsızın ağzındansa ahmaklık akar."));
trsuperobject.biblemap.put("b20_15_4", new trsuperobject(20,15,4,"Okşayıcı dil yaşam verirfı,Çarpık dilse ruhu yaralar."));
trsuperobject.biblemap.put("b20_15_5", new trsuperobject(20,15,5,"Ahmak babasının uyarılarını küçümser,İhtiyatlı kişi azara kulak verir."));
trsuperobject.biblemap.put("b20_15_6", new trsuperobject(20,15,6,"Doğru kişinin evi büyük hazine gibidir,Kötünün geliriyse sıkıntı kaynağıdır."));
trsuperobject.biblemap.put("b20_15_7", new trsuperobject(20,15,7,"Bilgelerin dudakları bilgi yayar,Ama akılsızların yüreği öyle değildir."));
trsuperobject.biblemap.put("b20_15_10", new trsuperobject(20,15,10,"Yoldan sapan şiddetle cezalandırılırVe azarlanmaktan nefret eden ölüme gider."));
trsuperobject.biblemap.put("b20_15_11", new trsuperobject(20,15,11,"RAB, ölüm ve yıkım diyarında olup biteni bilir,Nerde kaldı ki insanın yüreği!"));
trsuperobject.biblemap.put("b20_15_12", new trsuperobject(20,15,12,"Alaycı kişi azarlanmaktan hoşlanmaz,Bilgelere gidip danışmaz."));
trsuperobject.biblemap.put("b20_15_13", new trsuperobject(20,15,13,"Mutlu yürek yüzü neşelendirir,Acılı yürek ruhu ezer."));
trsuperobject.biblemap.put("b20_15_14", new trsuperobject(20,15,14,"Akıllı yürek bilgi arar,Akılsızın ağzıysa ahmaklıkla beslenir."));
trsuperobject.biblemap.put("b20_15_15", new trsuperobject(20,15,15,"Mazlumun bütün günleri sıkıntı doludur,Mutlu bir yürekse sahibine sürekli ziyafettir."));
trsuperobject.biblemap.put("b20_15_16", new trsuperobject(20,15,16,"Yoksul olup RABden korkmak,Zengin olup kaygı içinde yaşamaktan yeğdir."));
trsuperobject.biblemap.put("b20_15_17", new trsuperobject(20,15,17,"Sevgi dolu bir ortamdaki sebze yemeği,Nefret dolu bir ortamdaki besili danadan yeğdir."));
trsuperobject.biblemap.put("b20_15_18", new trsuperobject(20,15,18,"Huysuz kişi çekişme yaratır,Sabırlı kişi kavgayı yatıştırır."));
trsuperobject.biblemap.put("b20_15_19", new trsuperobject(20,15,19,"Tembelin yolu dikenli çit gibidir,Doğrunun yoluysa ana caddeye benzer."));
trsuperobject.biblemap.put("b20_15_20", new trsuperobject(20,15,20,"Bilge çocuk babasını sevindirir,Akılsız çocuksa annesini küçümser."));
trsuperobject.biblemap.put("b20_15_21", new trsuperobject(20,15,21,"Sağduyudan yoksun kişi ahmaklığıyla sevinir,Ama akıllı insan dürüst bir yaşam sürer."));
trsuperobject.biblemap.put("b20_15_22", new trsuperobject(20,15,22,"Karşılıklı danışılmazsa tasarılar boşa çıkar,Danışmanların çokluğuyla başarıya ulaşılır."));
trsuperobject.biblemap.put("b20_15_23", new trsuperobject(20,15,23,"Uygun yanıt sahibini mutlu eder,Yerinde söylenen söz ne güzeldir!"));
trsuperobject.biblemap.put("b20_15_24", new trsuperobject(20,15,24,"Sağduyulu kişi yukarıya, yaşama giden yoldadır,Bu da ölüler diyarına inmesini önler."));
trsuperobject.biblemap.put("b20_15_25", new trsuperobject(20,15,25,"RAB kibirlinin evini yıkar,Dul kadının sınırını korur."));
trsuperobject.biblemap.put("b20_15_26", new trsuperobject(20,15,26,"RAB kötünün tasarılarından iğrenir,Temiz düşüncelerden hoşnut kalır. temizdir››."));
trsuperobject.biblemap.put("b20_15_27", new trsuperobject(20,15,27,"Kazanca düşkün kişi kendi evine sıkıntı verir,Rüşvetten nefret edense rahat yaşar."));
trsuperobject.biblemap.put("b20_15_28", new trsuperobject(20,15,28,"Doğru kişinin aklı yanıtını iyi tartar,Kötünün ağzı kötülük saçar."));
trsuperobject.biblemap.put("b20_15_29", new trsuperobject(20,15,29,"RAB kötülerden uzak durur,Oysa doğruların duasını duyar."));
trsuperobject.biblemap.put("b20_15_30", new trsuperobject(20,15,30,"Gülen gözler yüreği sevindirir,İyi haber bedeni ferahlatır."));
trsuperobject.biblemap.put("b20_15_31", new trsuperobject(20,15,31,"Yaşam veren uyarıları dinleyen,Bilgeler arasında konaklar."));
trsuperobject.biblemap.put("b20_15_32", new trsuperobject(20,15,32,"Terbiyeden kaçan kendine zarar verir,Azara kulak verense sağduyu kazanır."));
trsuperobject.biblemap.put("b20_15_33", new trsuperobject(20,15,33,"RAB korkusu bilgelik öğretir,Alçakgönüllülük de onurun önkoşuludur."));
trsuperobject.biblemap.put("b20_16_1", new trsuperobject(20,16,1,"İnsan aklıyla çok şey tasarlayabilir,Ama dilin vereceği yanıt RABdendir."));
trsuperobject.biblemap.put("b20_16_2", new trsuperobject(20,16,2,"İnsan her yaptığını temiz sanır,Ama niyetlerini tartan RABdir."));
trsuperobject.biblemap.put("b20_16_3", new trsuperobject(20,16,3,"Yapacağın işleri RABbe emanet et,O zaman tasarıların gerçekleşir."));
trsuperobject.biblemap.put("b20_16_6", new trsuperobject(20,16,6,"Sevgi ve bağlılık suçları bağışlatır,RAB korkusu insanı kötülükten uzaklaştırır."));
trsuperobject.biblemap.put("b20_16_8", new trsuperobject(20,16,8,"Doğrulukla kazanılan az şeyHaksızlıkla kazanılan büyük gelirden iyidir."));
trsuperobject.biblemap.put("b20_16_9", new trsuperobject(20,16,9,"Kişi yüreğinde gideceği yolu tasarlar,Ama adımlarını RAB yönlendirir."));
trsuperobject.biblemap.put("b20_16_10", new trsuperobject(20,16,10,"Tanrı buyruklarını kralın ağzıyla açıklar,Bu nedenle kral adaleti çiğnememelidir."));
trsuperobject.biblemap.put("b20_16_11", new trsuperobject(20,16,11,"Doğru terazi ve baskül RABbindir,Bütün tartı ağırlıklarını O belirler."));
trsuperobject.biblemap.put("b20_16_12", new trsuperobject(20,16,12,"Krallar kötülükten iğrenir,Çünkü tahtın güvencesi adalettir."));
trsuperobject.biblemap.put("b20_16_13", new trsuperobject(20,16,13,"Kral doğru söyleyenden hoşnut kalır,Dürüst konuşanı sever."));
trsuperobject.biblemap.put("b20_16_14", new trsuperobject(20,16,14,"Kralın öfkesi ölüm habercisidir,Ama bilge kişi onu yatıştırır."));
trsuperobject.biblemap.put("b20_16_15", new trsuperobject(20,16,15,"Kralın yüzü gülüyorsa, yaşam demektir.Lütfu son yağmuru getiren bulut gibidir."));
trsuperobject.biblemap.put("b20_16_16", new trsuperobject(20,16,16,"Bilgelik kazanmak altından daha değerlidir,Akla sahip olmak da gümüşe yeğlenir."));
trsuperobject.biblemap.put("b20_16_17", new trsuperobject(20,16,17,"Dürüstlerin tuttuğu yol kötülükten uzaklaştırır,Yoluna dikkat eden, canını korur."));
trsuperobject.biblemap.put("b20_16_18", new trsuperobject(20,16,18,"Gururun ardından yıkım,Kibirli ruhun ardından da düşüş gelir."));
trsuperobject.biblemap.put("b20_16_19", new trsuperobject(20,16,19,"Mazlumlar arasında alçakgönüllü biri olmak,Kibirlilerle çapul malı paylaşmaktan iyidir."));
trsuperobject.biblemap.put("b20_16_20", new trsuperobject(20,16,20,"Öğüde kulak veren başarıya ulaşır,RABbe güvenen mutlu olur."));
trsuperobject.biblemap.put("b20_16_21", new trsuperobject(20,16,21,"Bilge yüreklilere akıllı denir,Tatlı söz ikna gücünü artırır."));
trsuperobject.biblemap.put("b20_16_22", new trsuperobject(20,16,22,"Sağduyu, sahibine yaşam kaynağı,Ahmaklıksa ahmaklara cezadır."));
trsuperobject.biblemap.put("b20_16_23", new trsuperobject(20,16,23,"Bilgenin aklı diline yön verir,Dudaklarının ikna gücünü artırır."));
trsuperobject.biblemap.put("b20_16_24", new trsuperobject(20,16,24,"Hoş sözler petek balı gibidir,Cana tatlı ve bedene şifadır."));
trsuperobject.biblemap.put("b20_16_25", new trsuperobject(20,16,25,"Öyle yol var ki, insana düz gibi görünür,Ama sonu ölümdür."));
trsuperobject.biblemap.put("b20_16_26", new trsuperobject(20,16,26,"Emekçinin iştahıdır onu çalıştıran,Çünkü açlığı onu kamçılar."));
trsuperobject.biblemap.put("b20_16_27", new trsuperobject(20,16,27,"Alçaklar başkalarına kötülük tasarlar,Konuşmaları kavurucu ateş gibidir."));
trsuperobject.biblemap.put("b20_16_28", new trsuperobject(20,16,28,"Huysuz kişi çekişmeyi körükler,Dedikoducu can dostları ayırır."));
trsuperobject.biblemap.put("b20_16_29", new trsuperobject(20,16,29,"Zorba kişi başkalarını ayartırVe onları olumsuz yola yöneltir."));
trsuperobject.biblemap.put("b20_16_30", new trsuperobject(20,16,30,"Göz kırpmak düzenbazlığa,Sinsi gülücükler kötülüğe işarettir."));
trsuperobject.biblemap.put("b20_16_31", new trsuperobject(20,16,31,"Ağarmış saçlar onur tacıdır,Doğru yaşayışla kazanılır."));
trsuperobject.biblemap.put("b20_16_32", new trsuperobject(20,16,32,"Sabırlı kişi yiğitten üstündür,Kendini denetleyen de kentler fethedenden üstündür."));
trsuperobject.biblemap.put("b20_16_33", new trsuperobject(20,16,33,"İnsan kura atar,Ama her kararı RAB verir."));
trsuperobject.biblemap.put("b20_17_1", new trsuperobject(20,17,1,"Huzur içinde kuru bir lokma,Kavga ve ziyafet dolu evden iyidir."));
trsuperobject.biblemap.put("b20_17_2", new trsuperobject(20,17,2,"Sağduyulu köle,Ailesini utanca sokan oğula egemen olurVe kardeşlerle birlikte mirastan pay alır."));
trsuperobject.biblemap.put("b20_17_3", new trsuperobject(20,17,3,"Altın ocakta, gümüş potada arıtılır,Yüreği arıtansa RABdir."));
trsuperobject.biblemap.put("b20_17_4", new trsuperobject(20,17,4,"Kötü kişi fesat yüklü dudakları dinler,Yalancı da yıkıcı dile kulak verir."));
trsuperobject.biblemap.put("b20_17_5", new trsuperobject(20,17,5,"Yoksulla alay eden, onu yaratanı hor görür.Felakete sevinen cezasız kalmaz."));
trsuperobject.biblemap.put("b20_17_6", new trsuperobject(20,17,6,"Torunlar yaşlıların tacıdır,Çocukların övüncü anne babalarıdır."));
trsuperobject.biblemap.put("b20_17_7", new trsuperobject(20,17,7,"Kurumlu sözler ahmağa nasıl yakışmazsa,Soyluya da yalancı dudaklar hiç yakışmaz."));
trsuperobject.biblemap.put("b20_17_8", new trsuperobject(20,17,8,"Sahibinin gözünde rüşvet bir tılsımdır.Ne yapsa başarılı olur."));
trsuperobject.biblemap.put("b20_17_9", new trsuperobject(20,17,9,"Sevgi isteyen kişi suçları bağışlar,Olayı diline dolayansa can dostları ayırır."));
trsuperobject.biblemap.put("b20_17_10", new trsuperobject(20,17,10,"Akıllı kişiyi azarlamak,Akılsıza yüz darbe vurmaktan etkilidir."));
trsuperobject.biblemap.put("b20_17_11", new trsuperobject(20,17,11,"Kötü kişi ancak başkaldırmaya eğilimlidir,Ona gönderilecek ulak acımasız olacaktır."));
trsuperobject.biblemap.put("b20_17_12", new trsuperobject(20,17,12,"Azgınlığı üstünde bir akılsızla karşılaşmak,Yavrularından edilmiş dişi ayıyla karşılaşmaktan beterdir."));
trsuperobject.biblemap.put("b20_17_13", new trsuperobject(20,17,13,"İyiliğin karşılığını kötülükle ödeyeninEvinden kötülük eksik olmaz."));
trsuperobject.biblemap.put("b20_17_14", new trsuperobject(20,17,14,"Kavganın başlangıcı su sızıntısına benzer,Bir patlamaya yol açmadan çekişmeyi bırak."));
trsuperobject.biblemap.put("b20_17_15", new trsuperobject(20,17,15,"Kötüyü aklayan da, doğruyu mahkûm eden deRABbi tiksindirir."));
trsuperobject.biblemap.put("b20_17_16", new trsuperobject(20,17,16,"Akılsız biri bilgelik satın almak için niye para harcasın?Zaten sağduyudan yoksun!"));
trsuperobject.biblemap.put("b20_17_17", new trsuperobject(20,17,17,"Dost her zaman sever,Kardeş sıkıntılı günde belli olur."));
trsuperobject.biblemap.put("b20_17_18", new trsuperobject(20,17,18,"Sağduyudan yoksun kişi el sıkışıpBaşkasına kefil olur."));
trsuperobject.biblemap.put("b20_17_19", new trsuperobject(20,17,19,"Başkaldırıyı seven kavgayı sever,Kapısını yüksek yapan yıkımına davetiye çıkarır."));
trsuperobject.biblemap.put("b20_17_20", new trsuperobject(20,17,20,"Sapık yürekli kişi iyilik beklememeli.Diliyle aldatan da belaya düşer."));
trsuperobject.biblemap.put("b20_17_21", new trsuperobject(20,17,21,"Akılsız kendisini doğurana derttir,Ahmağın babası sevinç nedir bilmez."));
trsuperobject.biblemap.put("b20_17_22", new trsuperobject(20,17,22,"İç ferahlığı sağlık getirir,Ezik ruh ise bedeni yıpratır."));
trsuperobject.biblemap.put("b20_17_23", new trsuperobject(20,17,23,"Kötü kişi adaleti saptırmak içinGizlice rüşvet alır."));
trsuperobject.biblemap.put("b20_17_24", new trsuperobject(20,17,24,"Akıllı kişi gözünü bilgelikten ayırmaz,Akılsızın gözüyse hep sağda soldadır."));
trsuperobject.biblemap.put("b20_17_25", new trsuperobject(20,17,25,"Akılsız çocuk babasına üzüntü,Annesine acı verir."));
trsuperobject.biblemap.put("b20_17_26", new trsuperobject(20,17,26,"Ne suçsuza ceza kesmek iyidir,Ne de görevliyi dürüst davrandığı için dövmek..."));
trsuperobject.biblemap.put("b20_17_27", new trsuperobject(20,17,27,"Bilgili kişi az konuşur,Akıllı kişi sakin ruhludur."));
trsuperobject.biblemap.put("b20_17_28", new trsuperobject(20,17,28,"Çenesini tutup susan ahmak bileBilge ve akıllı sayılır."));
trsuperobject.biblemap.put("b20_18_1", new trsuperobject(20,18,1,"Geçimsiz kişi kendi çıkarı peşindedir,İyi öğüde hep karşı çıkar."));
trsuperobject.biblemap.put("b20_18_2", new trsuperobject(20,18,2,"Akılsız kişi bir şey anlamaktan çokKendi düşüncelerini açmaktan hoşlanır."));
trsuperobject.biblemap.put("b20_18_3", new trsuperobject(20,18,3,"Kötülüğü aşağılanma,Ayıbı utanç izler."));
trsuperobject.biblemap.put("b20_18_4", new trsuperobject(20,18,4,"Bilge kişinin ağzından çıkan sözler derin sular gibidir,Bilgelik pınarı da coşkun bir akarsu."));
trsuperobject.biblemap.put("b20_18_5", new trsuperobject(20,18,5,"Kötüyü kayırmak da,Suçsuzdan adaleti esirgemek de iyi değildir."));
trsuperobject.biblemap.put("b20_18_6", new trsuperobject(20,18,6,"Akılsızın dudakları çekişmeye yol açar,Ağzı da dayağı davet eder."));
trsuperobject.biblemap.put("b20_18_7", new trsuperobject(20,18,7,"Akılsızın ağzı kendisini mahveder,Dudakları da canına tuzaktır."));
trsuperobject.biblemap.put("b20_18_8", new trsuperobject(20,18,8,"Dedikodu tatlı lokma gibidir,İnsanın ta içine işler."));
trsuperobject.biblemap.put("b20_18_9", new trsuperobject(20,18,9,"İşini savsaklayan kişiYıkıcıya kardeştir."));
trsuperobject.biblemap.put("b20_18_10", new trsuperobject(20,18,10,"RABbin adı güçlü kuledir,Ona sığınan doğru kişi için korunaktır."));
trsuperobject.biblemap.put("b20_18_11", new trsuperobject(20,18,11,"Zengin servetini bir kale,Aşılmaz bir sur sanır."));
trsuperobject.biblemap.put("b20_18_12", new trsuperobject(20,18,12,"Yürekteki gururu düşüş,Alçakgönüllülüğü ise onur izler."));
trsuperobject.biblemap.put("b20_18_13", new trsuperobject(20,18,13,"Dinlemeden yanıt vermekAhmaklık ve utançtır."));
trsuperobject.biblemap.put("b20_18_14", new trsuperobject(20,18,14,"İnsanın ruhu hastalıkta ona destektir.Ama ezik ruh nasıl dayanabilir?"));
trsuperobject.biblemap.put("b20_18_15", new trsuperobject(20,18,15,"Akıllı kişi bilgiyi satın alır,Bilgenin kulağı da bilgi peşindedir."));
trsuperobject.biblemap.put("b20_18_16", new trsuperobject(20,18,16,"Armağan, verenin yolunu açarVe kendisini büyüklerin önüne çıkartır."));
trsuperobject.biblemap.put("b20_18_17", new trsuperobject(20,18,17,"Duruşmada ilk konuşan haklı görünür,Başkası çıkıp onu sorgulayana dek."));
trsuperobject.biblemap.put("b20_18_18", new trsuperobject(20,18,18,"Kura çekişmeleri sona erdirir,Güçlü rakipleri uzlaştırır."));
trsuperobject.biblemap.put("b20_18_19", new trsuperobject(20,18,19,"Gücenmiş kardeş surlu kentten daha zor elde edilir.Çekişme sürgülü kale kapısı gibidir."));
trsuperobject.biblemap.put("b20_18_20", new trsuperobject(20,18,20,"İnsanın karnı ağzının meyvesiyle,Dudaklarının ürünüyle doyar."));
trsuperobject.biblemap.put("b20_18_21", new trsuperobject(20,18,21,"Dil ölüme de götürebilir, yaşama da;Konuşmayı seven, dilin meyvesine katlanmak zorundadır."));
trsuperobject.biblemap.put("b20_18_22", new trsuperobject(20,18,22,"İyi bir eş bulan iyilik bulurVe RABbin lütfuna erer."));
trsuperobject.biblemap.put("b20_18_23", new trsuperobject(20,18,23,"Yoksul acınma dilenir,Zenginin yanıtıysa serttir."));
trsuperobject.biblemap.put("b20_18_24", new trsuperobject(20,18,24,"Yıkıma götüren dostlar vardır,Ama öyle dost var ki, kardeşten yakındır insana. yıkıma gider››."));
trsuperobject.biblemap.put("b20_19_1", new trsuperobject(20,19,1,"Dürüst yaşayan bir yoksul olmak,Yalancı bir akılsız olmaktan yeğdir."));
trsuperobject.biblemap.put("b20_19_2", new trsuperobject(20,19,2,"Bilgisiz heves işe yaramaz,Acelecilik insanı yanılgıya düşürür."));
trsuperobject.biblemap.put("b20_19_3", new trsuperobject(20,19,3,"İnsanın ahmaklığı yaşamını yıkar,Yine de içinden RABbe öfkelenir."));
trsuperobject.biblemap.put("b20_19_4", new trsuperobject(20,19,4,"Zenginlik dost üstüne dost kazandırır.Oysa yoksulun dostu onu yüzüstü bırakır."));
trsuperobject.biblemap.put("b20_19_5", new trsuperobject(20,19,5,"Yalancı tanık cezasız kalmaz,Yalan soluyan kurtulamaz."));
trsuperobject.biblemap.put("b20_19_6", new trsuperobject(20,19,6,"Birçokları önemli kişinin gözüne girmekVe eli açık olanın dostu olmak ister."));
trsuperobject.biblemap.put("b20_19_7", new trsuperobject(20,19,7,"Yoksulun akrabaları bile onu sevmezse,Dostlarının ondan uzak duracağı daha da kesindir.Ne kadar yalvarsa ona yaklaşmazlar."));
trsuperobject.biblemap.put("b20_19_8", new trsuperobject(20,19,8,"Sağduyulu olan canını sever,Aklı izleyen bolluğa kavuşur."));
trsuperobject.biblemap.put("b20_19_9", new trsuperobject(20,19,9,"Yalancı tanık cezasız kalmaz,Yalan soluyan yok olur."));
trsuperobject.biblemap.put("b20_19_10", new trsuperobject(20,19,10,"Akılsızın gösterişli bir yaşam sürmesi uygun değilse,Kölelerin önderlere egemen olmasıHiç uygun değildir."));
trsuperobject.biblemap.put("b20_19_11", new trsuperobject(20,19,11,"Sağduyulu kişi sabırlıdır,Kusurları hoş görmesi ona onur kazandırır."));
trsuperobject.biblemap.put("b20_19_12", new trsuperobject(20,19,12,"Kralın öfkesi genç aslanın kükreyişine benzer,Lütfuysa otların üzerine düşen çiy gibidir."));
trsuperobject.biblemap.put("b20_19_13", new trsuperobject(20,19,13,"Akılsız çocuk babasının başına beladır,Dırdır eden kadın sürekli damlayan su gibidir."));
trsuperobject.biblemap.put("b20_19_14", new trsuperobject(20,19,14,"Ev ve servet babadan mirastır,Ama sağduyulu kadın RABbin armağanıdır."));
trsuperobject.biblemap.put("b20_19_15", new trsuperobject(20,19,15,"Tembellik insanı uyuşukluğa iter,Haylaz kişi de aç kalır."));
trsuperobject.biblemap.put("b20_19_16", new trsuperobject(20,19,16,"Tanrı buyruğuna uyan canını korur,Gitmesi gereken yolları umursamayan ölür."));
trsuperobject.biblemap.put("b20_19_17", new trsuperobject(20,19,17,"Yoksula acıyan kişi RABbe ödünç vermiş olur,Yaptığı iyilik için RAB onu ödüllendirir."));
trsuperobject.biblemap.put("b20_19_18", new trsuperobject(20,19,18,"Henüz umut varken çocuğunu eğit,Onun yıkımına neden olma."));
trsuperobject.biblemap.put("b20_19_19", new trsuperobject(20,19,19,"Huysuz insan cezasını çekmelidir.Onu bir kere kurtarsan da, hep aynı şeyi yapman gerekir."));
trsuperobject.biblemap.put("b20_19_20", new trsuperobject(20,19,20,"Öğüde kulak ver, terbiyeyi kabul et ki,Ömrünün kalan kısmı boyunca bilge olasın."));
trsuperobject.biblemap.put("b20_19_21", new trsuperobject(20,19,21,"İnsan yüreğinde çok şey tasarlar,Ama gerçekleşen, RABbin amacıdır."));
trsuperobject.biblemap.put("b20_19_22", new trsuperobject(20,19,22,"İnsandan istenen vefadır,Yoksul olmak yalancı olmaktan yeğdir."));
trsuperobject.biblemap.put("b20_19_23", new trsuperobject(20,19,23,"RAB korkusuDoygun ve dertsiz bir yaşama kavuşturur."));
trsuperobject.biblemap.put("b20_19_24", new trsuperobject(20,19,24,"Tembel sahana daldırdığı eliniAğzına geri götürmek bile istemez."));
trsuperobject.biblemap.put("b20_19_25", new trsuperobject(20,19,25,"Alaycıyı döversen bön kişi ibret alır,Akıllı kişiyi azarlarsan bilgisine bilgi katar."));
trsuperobject.biblemap.put("b20_19_26", new trsuperobject(20,19,26,"Babasına saldıran, annesini kovan çocuk,Ailesinin utancı ve yüzkarasıdır."));
trsuperobject.biblemap.put("b20_19_27", new trsuperobject(20,19,27,"Oğlum, uyarılara kulağını tıkarsan,Bilgi kaynağı sözlerden saparsın."));
trsuperobject.biblemap.put("b20_19_28", new trsuperobject(20,19,28,"Niyeti bozuk tanık adaletle eğlenir,Kötülerin ağzı fesatla beslenir."));
trsuperobject.biblemap.put("b20_19_29", new trsuperobject(20,19,29,"Alaycılar için ceza,Akılsızların sırtı için kötek hazırdır."));
trsuperobject.biblemap.put("b20_20_1", new trsuperobject(20,20,1,"Şarap insanı alaycı, içki gürültücü yapar,Onun etkisiyle yoldan sapan bilge değildir."));
trsuperobject.biblemap.put("b20_20_2", new trsuperobject(20,20,2,"Kralın öfkesi genç aslanın kükreyişine benzer,Onu kızdıran canından olur."));
trsuperobject.biblemap.put("b20_20_3", new trsuperobject(20,20,3,"Kavgadan kaçınmak insan için onurdur,Oysa her ahmak tartışmaya hazırdır."));
trsuperobject.biblemap.put("b20_20_4", new trsuperobject(20,20,4,"Sonbaharda çift sürmeyen tembel,Hasatta aradığını bulamaz."));
trsuperobject.biblemap.put("b20_20_5", new trsuperobject(20,20,5,"İnsanın niyetleri derin bir kuyunun suları gibidir,Akıllı kişi onları açığa çıkarır."));
trsuperobject.biblemap.put("b20_20_6", new trsuperobject(20,20,6,"İnsanların çoğu, ‹‹Vefalıyım›› der.Ama sadık birini kim bulabilir?"));
trsuperobject.biblemap.put("b20_20_7", new trsuperobject(20,20,7,"Doğru ve dürüst bir babayaSahip olan çocuklara ne mutlu!"));
trsuperobject.biblemap.put("b20_20_8", new trsuperobject(20,20,8,"Yargı kürsüsünde oturan kral,Kötülüğü gözleriyle ayıklar."));
trsuperobject.biblemap.put("b20_20_9", new trsuperobject(20,20,9,"Kim, ‹‹Yüreğimi pak kıldım,Günahımdan arındım›› diyebilir?"));
trsuperobject.biblemap.put("b20_20_10", new trsuperobject(20,20,10,"RAB hileli tartıdan da, hileli ölçüden de tiksinir."));
trsuperobject.biblemap.put("b20_20_11", new trsuperobject(20,20,11,"Çocuk bile eylemleriyle kendini belli eder,Yaptıkları pak ve doğru mu, değil mi, anlaşılır."));
trsuperobject.biblemap.put("b20_20_12", new trsuperobject(20,20,12,"İşiten kulağı da gören gözü deRAB yaratmıştır."));
trsuperobject.biblemap.put("b20_20_13", new trsuperobject(20,20,13,"Uykuyu seversen yoksullaşırsın,Uyanık durursan ekmeğin bol olur."));
trsuperobject.biblemap.put("b20_20_14", new trsuperobject(20,20,14,"Alıcı, ‹‹İşe yaramaz, işe yaramaz›› der,Ama alıp gittikten sonra aldığıyla övünür."));
trsuperobject.biblemap.put("b20_20_15", new trsuperobject(20,20,15,"Bol bol altının, mücevherin olabilir,Ama bilgi akıtan dudaklar daha değerlidir."));
trsuperobject.biblemap.put("b20_20_16", new trsuperobject(20,20,16,"Tanımadığı birine kefil olanın giysisini al;Bir yabancı için yapıyorsa bunu,Giysisini rehin tut."));
trsuperobject.biblemap.put("b20_20_17", new trsuperobject(20,20,17,"Hileyle kazanılan yiyecek insana tatlı gelir,Ama sonra ağza dolan çakıl gibidir."));
trsuperobject.biblemap.put("b20_20_18", new trsuperobject(20,20,18,"Tasarılarını danışarak yap,Yöntemlere uyarak savaş."));
trsuperobject.biblemap.put("b20_20_19", new trsuperobject(20,20,19,"Dedikoducu sır saklayamaz,Bu nedenle ağzı gevşek olanla arkadaşlık etme."));
trsuperobject.biblemap.put("b20_20_20", new trsuperobject(20,20,20,"Annesine ya da babasına söveninIşığı zifiri karanlıkta sönecek."));
trsuperobject.biblemap.put("b20_20_21", new trsuperobject(20,20,21,"Tez elde edilen mirasınSonu bereketli olmaz."));
trsuperobject.biblemap.put("b20_20_22", new trsuperobject(20,20,22,"‹‹Bu kötülüğü sana ödeteceğim›› deme;RABbi bekle, O seni kurtarır."));
trsuperobject.biblemap.put("b20_20_23", new trsuperobject(20,20,23,"RAB hileli tartıdan tiksinir,Hileli teraziden hoşlanmaz."));
trsuperobject.biblemap.put("b20_20_24", new trsuperobject(20,20,24,"İnsanın adımlarını RAB yönlendirir;Öyleyse insan tuttuğu yolu nasıl anlayabilir?"));
trsuperobject.biblemap.put("b20_20_25", new trsuperobject(20,20,25,"Düşünmeden adakta bulunmakSakıncalıdır."));
trsuperobject.biblemap.put("b20_20_26", new trsuperobject(20,20,26,"Bilge kral kötüleri ayıklar,Harman döver gibi cezalandırır."));
trsuperobject.biblemap.put("b20_20_27", new trsuperobject(20,20,27,"İnsanın ruhu RABbin ışığıdır,İç varlığın derinliklerine işler."));
trsuperobject.biblemap.put("b20_20_28", new trsuperobject(20,20,28,"Sevgi ve sadakat kralın güvencesidir.Onun tahtını sağlamlaştıran sevgidir."));
trsuperobject.biblemap.put("b20_20_29", new trsuperobject(20,20,29,"Gençlerin görkemi güçleri,Yaşlıların onuru ağarmış saçlardır."));
trsuperobject.biblemap.put("b20_20_30", new trsuperobject(20,20,30,"Yaralayan darbeler kötülüğü temizler,Kötek iç varlığın derinliklerini paklar."));
trsuperobject.biblemap.put("b20_21_1", new trsuperobject(20,21,1,"Kralın yüreği RABbin elindedir,Kanaldaki su gibi onu istediği yöne çevirir."));
trsuperobject.biblemap.put("b20_21_2", new trsuperobject(20,21,2,"İnsan izlediği her yolun doğru olduğunu sanır,Ama niyetlerini tartan RABdir."));
trsuperobject.biblemap.put("b20_21_4", new trsuperobject(20,21,4,"Küstah bakışlar ve kibirli yürekKötülerin çırası ve günahıdır."));
trsuperobject.biblemap.put("b20_21_5", new trsuperobject(20,21,5,"Çalışkanın tasarıları hep bollukla,Her türlü acelecilik hep yoklukla sonuçlanır."));
trsuperobject.biblemap.put("b20_21_6", new trsuperobject(20,21,6,"Yalan dolanla yapılan servet,Sis gibi geçicidir ve ölüm tuzağıdır."));
trsuperobject.biblemap.put("b20_21_7", new trsuperobject(20,21,7,"Kötülerin zorbalığı kendilerini süpürüp götürür,Çünkü doğru olanı yapmaya yanaşmazlar."));
trsuperobject.biblemap.put("b20_21_8", new trsuperobject(20,21,8,"Suçlunun yolu dolambaçlı,Pak kişinin yaptıklarıysa dosdoğrudur."));
trsuperobject.biblemap.put("b20_21_9", new trsuperobject(20,21,9,"Kavgacı kadınla aynı evde oturmaktansa,Damın köşesinde oturmak yeğdir."));
trsuperobject.biblemap.put("b20_21_10", new trsuperobject(20,21,10,"Kötünün can attığı kötülüktür,Hiç kimseye acımaz."));
trsuperobject.biblemap.put("b20_21_11", new trsuperobject(20,21,11,"Alaycı cezalandırılınca bön kişi akıllanır,Bilge olan öğretilenden bilgi kazanır."));
trsuperobject.biblemap.put("b20_21_12", new trsuperobject(20,21,12,"Adil Olan, kötünün evini dikkatle gözlerVe kötüleri yıkıma uğratır."));
trsuperobject.biblemap.put("b20_21_13", new trsuperobject(20,21,13,"Yoksulun feryadına kulağını tıkayanınFeryadına yanıt verilmeyecektir."));
trsuperobject.biblemap.put("b20_21_14", new trsuperobject(20,21,14,"Gizlice verilen armağan öfkeyi,Koyna sokuşturulan rüşvet de kızgın gazabı yatıştırır."));
trsuperobject.biblemap.put("b20_21_15", new trsuperobject(20,21,15,"Hak yerine gelince doğru kişi sevinir,Fesatçı dehşete düşer."));
trsuperobject.biblemap.put("b20_21_16", new trsuperobject(20,21,16,"Sağduyudan uzaklaşan,Kendini ölüler arasında bulur."));
trsuperobject.biblemap.put("b20_21_17", new trsuperobject(20,21,17,"Zevkine düşkün olan yoksullaşır,Şaraba ve zeytinyağına düşkün kişi de zengin olmaz."));
trsuperobject.biblemap.put("b20_21_18", new trsuperobject(20,21,18,"Kötü kişi doğru kişinin fidyesidir,Hain de dürüstün."));
trsuperobject.biblemap.put("b20_21_19", new trsuperobject(20,21,19,"Çölde yaşamak,Can sıkıcı ve kavgacı kadınla yaşamaktan yeğdir."));
trsuperobject.biblemap.put("b20_21_20", new trsuperobject(20,21,20,"Bilgenin evi değerli eşya ve zeytinyağıyla doludur,Akılsızsa malını har vurup harman savurur."));
trsuperobject.biblemap.put("b20_21_21", new trsuperobject(20,21,21,"Doğruluğun ve sevginin ardından koşan,Yaşam, gönenç ve onur bulur."));
trsuperobject.biblemap.put("b20_21_22", new trsuperobject(20,21,22,"Bilge kişi güçlülerin kentine saldırıpGüvendikleri kaleyi yıkar."));
trsuperobject.biblemap.put("b20_21_23", new trsuperobject(20,21,23,"Ağzını ve dilini tutanBaşını beladan korur."));
trsuperobject.biblemap.put("b20_21_24", new trsuperobject(20,21,24,"Gururlu, küstah ve alaycı:Bunlar kas kas kasılan insanın adlarıdır."));
trsuperobject.biblemap.put("b20_21_25", new trsuperobject(20,21,25,"Tembelin isteği onu ölüme götürür,Çünkü elleri çalışmaktan kaçınır;"));
trsuperobject.biblemap.put("b20_21_26", new trsuperobject(20,21,26,"Bütün gün isteklerini sıralar durur,Oysa doğru kişi esirgemeden verir."));
trsuperobject.biblemap.put("b20_21_27", new trsuperobject(20,21,27,"Kötülerin sunduğu kurban iğrençtir,Hele bunu kötü niyetle sunarlarsa."));
trsuperobject.biblemap.put("b20_21_28", new trsuperobject(20,21,28,"Yalancı tanık yok olur,Dinlemeyi bilenin tanıklığıysa inandırıcıdır."));
trsuperobject.biblemap.put("b20_21_29", new trsuperobject(20,21,29,"Kötü kişi kendine güçlü bir görünüm verir,Erdemli insansa tuttuğu yoldan emindir."));
trsuperobject.biblemap.put("b20_21_30", new trsuperobject(20,21,30,"RABbe karşı başarılı olabilecekBilgelik, akıl ve tasarı yoktur."));
trsuperobject.biblemap.put("b20_21_31", new trsuperobject(20,21,31,"At savaş günü için hazır tutulur,Ama zafer sağlayan RAB'dir."));
trsuperobject.biblemap.put("b20_22_1", new trsuperobject(20,22,1,"İyi ad büyük servetten,Saygınlık gümüş ve altından yeğdir."));
trsuperobject.biblemap.put("b20_22_2", new trsuperobject(20,22,2,"Zenginle yoksulun ortak yönü şu:Her ikisini de RAB yarattı."));
trsuperobject.biblemap.put("b20_22_3", new trsuperobject(20,22,3,"İhtiyatlı kişi tehlikeyi görünce saklanır,Bönse öne atılır ve zarar görür."));
trsuperobject.biblemap.put("b20_22_4", new trsuperobject(20,22,4,"Alçakgönüllülüğün ve RAB korkusunun ödülü,Zenginlik, onur ve yaşamdır."));
trsuperobject.biblemap.put("b20_22_5", new trsuperobject(20,22,5,"Kötünün yolu diken ve tuzakla doludur.Canını korumak isteyen bunlardan uzak durur."));
trsuperobject.biblemap.put("b20_22_6", new trsuperobject(20,22,6,"Çocuğu tutması gereken yola göre yetiştir,Yaşlandığında o yoldan ayrılmaz."));
trsuperobject.biblemap.put("b20_22_7", new trsuperobject(20,22,7,"Zengin yoksullara egemen olur,Borç alan borç verenin kulu olur."));
trsuperobject.biblemap.put("b20_22_8", new trsuperobject(20,22,8,"Fesat eken dert biçer,Gazabının değneği yok olur."));
trsuperobject.biblemap.put("b20_22_9", new trsuperobject(20,22,9,"Cömert olan kutsanır,Çünkü yemeğini yoksullarla paylaşır."));
trsuperobject.biblemap.put("b20_22_10", new trsuperobject(20,22,10,"Alaycıyı kov, kavga biter;Çekişme ve aşağılamalar da sona erer."));
trsuperobject.biblemap.put("b20_22_11", new trsuperobject(20,22,11,"Yürek temizliğini ve güzel sözleri seven,Kralın dostluğunu kazanır."));
trsuperobject.biblemap.put("b20_22_12", new trsuperobject(20,22,12,"RAB bilgiyi gözetip korur,Hainin sözlerini ise altüst eder."));
trsuperobject.biblemap.put("b20_22_13", new trsuperobject(20,22,13,"Tembel der ki, ‹‹Dışarda aslan var,Sokağa çıksam beni parçalar.››"));
trsuperobject.biblemap.put("b20_22_14", new trsuperobject(20,22,14,"Sokak kadınının ağzı dipsiz çukur gibidir,RABbin gazabına uğrayan oraya düşer."));
trsuperobject.biblemap.put("b20_22_15", new trsuperobject(20,22,15,"Akılsızlık çocuğun öz yapısındadır,Değnekle terbiye edilirse akılsızlıktan uzaklaşır."));
trsuperobject.biblemap.put("b20_22_16", new trsuperobject(20,22,16,"Servetini büyütmek için yoksulu ezenleZengine armağan verenin sonu yoksulluktur."));
trsuperobject.biblemap.put("b20_22_17", new trsuperobject(20,22,17,"Kulak ver, bilgelerin sözlerini dinle,Öğrettiğimi zihnine işle."));
trsuperobject.biblemap.put("b20_22_18", new trsuperobject(20,22,18,"Sözlerimi yüreğinde saklarsan mutlu olursun,Onlar hep hazır olsun dudaklarında."));
trsuperobject.biblemap.put("b20_22_19", new trsuperobject(20,22,19,"RABbe güvenmen içinBugün bunları sana, evet sana da bildiriyorum."));
trsuperobject.biblemap.put("b20_22_20", new trsuperobject(20,22,20,"Senin için otuz söz yazdım,Bilgi ve öğüt sözleri..."));
trsuperobject.biblemap.put("b20_22_21", new trsuperobject(20,22,21,"Öyle ki, güvenilir, doğru sözleri bilesin,Böylece seni gönderene güvenilir yanıt verebilesin."));
trsuperobject.biblemap.put("b20_22_22", new trsuperobject(20,22,22,"Yoksulu, yoksul olduğu için soymaya kalkma,Düşkünü mahkemede ezme. Masoretik metinde geçmemektedir."));
trsuperobject.biblemap.put("b20_22_23", new trsuperobject(20,22,23,"Çünkü onların davasını RAB yüklenecekVe onları soyanların canını alacak."));
trsuperobject.biblemap.put("b20_22_24", new trsuperobject(20,22,24,"Huysuz kişiyle arkadaşlık etme;Tez öfkelenenle yola çıkma."));
trsuperobject.biblemap.put("b20_22_25", new trsuperobject(20,22,25,"Yoksa onun yollarına alışır,Kendini tuzağa düşmüş bulursun."));
trsuperobject.biblemap.put("b20_22_26", new trsuperobject(20,22,26,"El sıkışıpBaşkasının borcuna kefil olmaktan kaçın."));
trsuperobject.biblemap.put("b20_22_27", new trsuperobject(20,22,27,"Ödeyecek paran olmazsa,Altındaki döşeğe bile el koyarlar."));
trsuperobject.biblemap.put("b20_22_28", new trsuperobject(20,22,28,"Atalarının belirlediğiEski sınır taşlarının yerini değiştirme."));
trsuperobject.biblemap.put("b20_22_29", new trsuperobject(20,22,29,"İşinde usta birini görüyor musun?Öylesi sıradan kişilere değil,Krallara bile hizmet eder."));
trsuperobject.biblemap.put("b20_23_1", new trsuperobject(20,23,1,"Bir önderle yemeğe oturduğundaÖnüne konulana dikkat et."));
trsuperobject.biblemap.put("b20_23_2", new trsuperobject(20,23,2,"İştahına yenilecek olursan,Daya bıçağı kendi boğazına."));
trsuperobject.biblemap.put("b20_23_3", new trsuperobject(20,23,3,"Onun lezzetli yemeklerini çekmesin canın,Böyle yemeğin ardında hile olabilir."));
trsuperobject.biblemap.put("b20_23_4", new trsuperobject(20,23,4,"Zengin olmak için didinip durma,Çıkar bunu aklından."));
trsuperobject.biblemap.put("b20_23_5", new trsuperobject(20,23,5,"Servet göz açıp kapayana dek yok olur,Kanatlanıp kartal gibi göklere uçar."));
trsuperobject.biblemap.put("b20_23_6", new trsuperobject(20,23,6,"Cimrinin verdiği yemeği yeme,Lezzetli yemeklerini çekmesin canın."));
trsuperobject.biblemap.put("b20_23_7", new trsuperobject(20,23,7,"Çünkü yediğin her şeyin hesabını tutar,‹‹Ye, iç›› der sana,Ama yüreği senden yana değildir."));
trsuperobject.biblemap.put("b20_23_8", new trsuperobject(20,23,8,"Yediğin azıcık yemeği kusarsın,Söylediğin güzel sözler de boşa gider."));
trsuperobject.biblemap.put("b20_23_9", new trsuperobject(20,23,9,"Akılsıza öğüt vermeye kalkma,Çünkü senin sözlerindeki sağduyuyu küçümser."));
trsuperobject.biblemap.put("b20_23_10", new trsuperobject(20,23,10,"Eski sınır taşlarının yerini değiştirme,Öksüzlerin toprağına el sürme."));
trsuperobject.biblemap.put("b20_23_11", new trsuperobject(20,23,11,"Çünkü onların Velisi güçlüdürVe onların davasını sana karşı O yürütür. kurtarıcılığı vurguluyor."));
trsuperobject.biblemap.put("b20_23_12", new trsuperobject(20,23,12,"Uyarıları zihnine işle,Bilgi dolu sözlere kulak ver."));
trsuperobject.biblemap.put("b20_23_13", new trsuperobject(20,23,13,"Çocuğunu terbiye etmekten geri kalma,Onu değnekle dövsen de ölmez."));
trsuperobject.biblemap.put("b20_23_14", new trsuperobject(20,23,14,"Onu değnekle döversen,Canını ölüler diyarından kurtarırsın."));
trsuperobject.biblemap.put("b20_23_15", new trsuperobject(20,23,15,"Oğlum, bilge yürekli olursan,Benim yüreğim de sevinir."));
trsuperobject.biblemap.put("b20_23_16", new trsuperobject(20,23,16,"Dudakların doğru konuştuğundaGönlüm de coşar."));
trsuperobject.biblemap.put("b20_23_17", new trsuperobject(20,23,17,"Günahkârlara imrenmektense,Sürekli RAB korkusunda yaşa."));
trsuperobject.biblemap.put("b20_23_18", new trsuperobject(20,23,18,"Böylece bir geleceğin olurVe umudun boşa çıkmaz."));
trsuperobject.biblemap.put("b20_23_19", new trsuperobject(20,23,19,"Oğlum, dinle ve bilge ol,Yüreğini doğru yolda tut."));
trsuperobject.biblemap.put("b20_23_20", new trsuperobject(20,23,20,"Aşırı şarap içenlerle,Ete düşkün oburlarla arkadaşlık etme."));
trsuperobject.biblemap.put("b20_23_21", new trsuperobject(20,23,21,"Çünkü ayyaş ve obur kişi yoksullaşır,Uyuşukluk da insana paçavra giydirir."));
trsuperobject.biblemap.put("b20_23_22", new trsuperobject(20,23,22,"Sana yaşam veren babanın sözlerine kulak ver,Yaşlandığı zaman anneni hor görme."));
trsuperobject.biblemap.put("b20_23_23", new trsuperobject(20,23,23,"Gerçeği satın al ve satma;Bilgeliği, terbiyeyi, aklı da."));
trsuperobject.biblemap.put("b20_23_24", new trsuperobject(20,23,24,"Doğru kişinin babası coştukça coşar,Bilgece davranan oğulun babası sevinir."));
trsuperobject.biblemap.put("b20_23_25", new trsuperobject(20,23,25,"Annenle baban seninle coşsun,Seni doğuran sevinsin."));
trsuperobject.biblemap.put("b20_23_26", new trsuperobject(20,23,26,"Oğlum, beni yürekten dinle,Gözünü gittiğim yoldan ayırma."));
trsuperobject.biblemap.put("b20_23_27", new trsuperobject(20,23,27,"Çünkü fahişe derin bir çukur,Ahlaksız kadın dar bir kuyudur."));
trsuperobject.biblemap.put("b20_23_28", new trsuperobject(20,23,28,"Evet, soyguncu gibi pusuda beklerVe birçok erkeği yoldan çıkarır."));
trsuperobject.biblemap.put("b20_23_29", new trsuperobject(20,23,29,"Ah çeken kim? Vah çeken kim?Kimdir çekişip duran?Yakınan kim? Boş yere yaralanan kim?Gözleri kanlı olan kim?"));
trsuperobject.biblemap.put("b20_23_30", new trsuperobject(20,23,30,"İçmeye oturup kalkamayanlar,Karışık şarapları denemeye gidenlerdir."));
trsuperobject.biblemap.put("b20_23_31", new trsuperobject(20,23,31,"Şarabın kızıl rengine,Kadehte ışımasına,Boğazdan aşağı süzülüvermesine bakma."));
trsuperobject.biblemap.put("b20_23_32", new trsuperobject(20,23,32,"Sonunda yılan gibi ısırır,Engerek gibi sokar."));
trsuperobject.biblemap.put("b20_23_33", new trsuperobject(20,23,33,"Gözlerin garip şeyler görür,Aklından ahlaksızlıklar geçer."));
trsuperobject.biblemap.put("b20_23_34", new trsuperobject(20,23,34,"Kendini kâh denizin ortasında,Kâh gemi direğinin tepesinde yatıyor sanırsın."));
trsuperobject.biblemap.put("b20_23_35", new trsuperobject(20,23,35,"‹‹Dövdüler beni ama incinmedim,Vurdular ama farketmedim›› dersin,‹‹Yeniden içmek için ne zaman ayılacağım?››"));
trsuperobject.biblemap.put("b20_24_1", new trsuperobject(20,24,1,"Kötülere imrenme,Onlarla birlikte olmayı isteme."));
trsuperobject.biblemap.put("b20_24_2", new trsuperobject(20,24,2,"Çünkü yürekleri zorbalık tasarlar,Dudakları belalardan söz eder."));
trsuperobject.biblemap.put("b20_24_3", new trsuperobject(20,24,3,"Ev bilgelikle yapılır,Akılla pekiştirilir."));
trsuperobject.biblemap.put("b20_24_4", new trsuperobject(20,24,4,"Bilgi sayesinde odalarıHer türlü değerli, güzel eşyayla dolar."));
trsuperobject.biblemap.put("b20_24_5", new trsuperobject(20,24,5,"Bilgelik güçten,Bilgi kaba kuvvetten üstündür. üstündür›› (bkz. Septuaginta), Masoretik metin ‹‹Bilge güçlü olur, bilgi sahibi gücünü artırır.››"));
trsuperobject.biblemap.put("b20_24_6", new trsuperobject(20,24,6,"Savaşmak için yöntem,Zafer kazanmak için birçok danışman gerekli."));
trsuperobject.biblemap.put("b20_24_7", new trsuperobject(20,24,7,"Ahmak için bilgelik ulaşılamayacak kadar yüksektir,Kent kurulunda ağzını açamaz."));
trsuperobject.biblemap.put("b20_24_8", new trsuperobject(20,24,8,"Kötülük tasarlayan kişiDüzenbaz olarak bilinecektir."));
trsuperobject.biblemap.put("b20_24_9", new trsuperobject(20,24,9,"Ahmakça tasarılar günahtır,Alaycı kişiden herkes iğrenir."));
trsuperobject.biblemap.put("b20_24_10", new trsuperobject(20,24,10,"Sıkıntılı günde cesaretini yitirirsen,Gücün kıt demektir."));
trsuperobject.biblemap.put("b20_24_11", new trsuperobject(20,24,11,"Ölüm tehlikesi içinde olanları kurtar,Ölmek üzere olanları esirge."));
trsuperobject.biblemap.put("b20_24_12", new trsuperobject(20,24,12,"‹‹İşte bunu bilmiyordum›› desen de,İnsanın yüreğindekini bilen sezmez mi?Senin canını koruyan anlamaz mı?Ödetmez mi herkese yaptığını?"));
trsuperobject.biblemap.put("b20_24_13", new trsuperobject(20,24,13,"Oğlum, bal ye, çünkü iyidir,Süzme bal damağa tatlı gelir."));
trsuperobject.biblemap.put("b20_24_14", new trsuperobject(20,24,14,"Bilgelik de canın için öyledir, bilmiş ol.Bilgeliği bulursan bir geleceğin olurVe umudun boşa çıkmaz."));
trsuperobject.biblemap.put("b20_24_15", new trsuperobject(20,24,15,"Ey kötü adam, doğru kişinin evine karşı pusuya yatma,Konutunu yıkmaya kalkma."));
trsuperobject.biblemap.put("b20_24_16", new trsuperobject(20,24,16,"Çünkü doğru kişi yedi kez düşse yine kalkar,Ama kötüler felakette yıkılır."));
trsuperobject.biblemap.put("b20_24_17", new trsuperobject(20,24,17,"Düşmanın düşüşüne keyiflenme,Sendelemesine sevinme."));
trsuperobject.biblemap.put("b20_24_18", new trsuperobject(20,24,18,"Yoksa RAB görür ve hoşnut kalmazVe düşmanına duyduğu öfke yatışır."));
trsuperobject.biblemap.put("b20_24_19", new trsuperobject(20,24,19,"Kötülük edenlere kızıp üzülme,Onlara özenme."));
trsuperobject.biblemap.put("b20_24_20", new trsuperobject(20,24,20,"Çünkü kötülerin geleceği yok,Çırası sönecek onların."));
trsuperobject.biblemap.put("b20_24_21", new trsuperobject(20,24,21,"Oğlum, RABbe ve krala saygı göster,Onlara başkaldıranlarla arkadaşlık etme."));
trsuperobject.biblemap.put("b20_24_22", new trsuperobject(20,24,22,"Çünkü onlar ansızın felakete uğrar,İnsanın başına ne belalar getireceklerini kim bilir?"));
trsuperobject.biblemap.put("b20_24_23", new trsuperobject(20,24,23,"Şunlar da bilgelerin sözleridir:Yargılarken yan tutmak iyi değildir."));
trsuperobject.biblemap.put("b20_24_24", new trsuperobject(20,24,24,"Kötüye, ‹‹Suçsuzsun›› diyen yargıcıHalklar lanetler, uluslar kınar."));
trsuperobject.biblemap.put("b20_24_25", new trsuperobject(20,24,25,"Ne mutlu suçluyu mahkûm edene!Herkes onu candan kutlar."));
trsuperobject.biblemap.put("b20_24_26", new trsuperobject(20,24,26,"Dürüst yanıtGerçek dostluğun işaretidir. ‹‹Dürüst yanıt veren dudakları öper.››"));
trsuperobject.biblemap.put("b20_24_27", new trsuperobject(20,24,27,"İlkin dışardaki işini bitirip tarlanı hazırla,Ondan sonra evini yap."));
trsuperobject.biblemap.put("b20_24_28", new trsuperobject(20,24,28,"Başkalarına karşı nedensiz tanıklık etmeVe dudaklarınla aldatma."));
trsuperobject.biblemap.put("b20_24_29", new trsuperobject(20,24,29,"‹‹Bana yaptığını ben de ona yapacağım,Ödeteceğim bana yaptığını›› deme."));
trsuperobject.biblemap.put("b20_24_30", new trsuperobject(20,24,30,"Tembelin tarlasından,Sağduyudan yoksun kişinin bağından geçtiğimde"));
trsuperobject.biblemap.put("b20_24_31", new trsuperobject(20,24,31,"Her yanı dikenlerin, otlarınKapladığını gördüm;Taş duvar da yıkılmıştı."));
trsuperobject.biblemap.put("b20_24_32", new trsuperobject(20,24,32,"Gördüklerimi derin derin düşündüm,Seyrettiklerimden ibret aldım."));
trsuperobject.biblemap.put("b20_24_33", new trsuperobject(20,24,33,"‹‹Biraz kestireyim, biraz uyuklayayım,Ellerimi kavuşturup şöyle bir uyuyayım›› demeye kalmadan,"));
trsuperobject.biblemap.put("b20_24_34", new trsuperobject(20,24,34,"Yokluk bir haydut gibi,Yoksulluk bir akıncı gibi gelir üzerine."));
trsuperobject.biblemap.put("b20_25_1", new trsuperobject(20,25,1,"Bundan sonrakiler de Süleymanın özdeyişleridir.Bunları Yahuda Kralı Hizkiyanın adamları derledi."));
trsuperobject.biblemap.put("b20_25_2", new trsuperobject(20,25,2,"Tanrıyı gizli tuttuğu şeyler için,Krallarıysa açığa çıkardıkları için yüceltiriz."));
trsuperobject.biblemap.put("b20_25_3", new trsuperobject(20,25,3,"Göğün yüksekliği, yerin derinliği gibi,Kralların aklından geçen de kestirilemez."));
trsuperobject.biblemap.put("b20_25_4", new trsuperobject(20,25,4,"Cürufu gümüşten ayırınca,Kuyumcunun işleyeceği madde kalır."));
trsuperobject.biblemap.put("b20_25_5", new trsuperobject(20,25,5,"Kötüleri kralın huzurundan uzaklaştırırsanKralın tahtı adaletle pekişir."));
trsuperobject.biblemap.put("b20_25_6", new trsuperobject(20,25,6,"Kralın önünde kendini yüceltme,Önemli kişiler arasında yer edinmeye çalışma."));
trsuperobject.biblemap.put("b20_25_7", new trsuperobject(20,25,7,"Çünkü kralın seni bir soylunun önünde alaşağı etmesindense,Sana, ‹‹Yukarıya gel›› demesi yeğdir."));
trsuperobject.biblemap.put("b20_25_8", new trsuperobject(20,25,8,"Gördüklerinle hemencecik mahkemeye başvurma;Çünkü başkası seni utandırabilir,Sonra ne yapacağını bilemezsin."));
trsuperobject.biblemap.put("b20_25_9", new trsuperobject(20,25,9,"Davanı doğrudan komşunla gör;Başkasının sırrını açıklama."));
trsuperobject.biblemap.put("b20_25_10", new trsuperobject(20,25,10,"Yoksa işiten seni utandırabilirVe bu kötü ün yakanı bırakmaz."));
trsuperobject.biblemap.put("b20_25_11", new trsuperobject(20,25,11,"Yerinde söylenen söz,Gümüş oymalardaki altın elmafö gibidir."));
trsuperobject.biblemap.put("b20_25_12", new trsuperobject(20,25,12,"Altın küpe ya da altın bir süs neyse,Dinleyen kulak için bilgenin azarlaması da öyledir."));
trsuperobject.biblemap.put("b20_25_13", new trsuperobject(20,25,13,"Hasatta kar serinliği nasılsa,Güvenilir ulak da kendisini gönderenler için öyledir.Böyle biri efendilerinin canına can katar."));
trsuperobject.biblemap.put("b20_25_14", new trsuperobject(20,25,14,"Yağmursuz bulut ve yel nasılsa,Vermediği armağanla övünen kişi de öyledir."));
trsuperobject.biblemap.put("b20_25_15", new trsuperobject(20,25,15,"Sabırla bir hükümdar bile ikna edilir,Tatlı dil en güçlü direnci kırar."));
trsuperobject.biblemap.put("b20_25_16", new trsuperobject(20,25,16,"Bal buldun mu yeteri kadar ye,Fazla doyarsan kusarsın."));
trsuperobject.biblemap.put("b20_25_17", new trsuperobject(20,25,17,"Başkalarının evine seyrek git,Yoksa onları bezdirir, nefretini kazanırsın."));
trsuperobject.biblemap.put("b20_25_18", new trsuperobject(20,25,18,"Başkasına karşı yalancı tanıklık edenTopuz, kılıç ya da sivri ok gibidir."));
trsuperobject.biblemap.put("b20_25_19", new trsuperobject(20,25,19,"Sıkıntılı günde haine güvenmek,Çürük dişe ya da sakat ayağa güvenmek gibidir."));
trsuperobject.biblemap.put("b20_25_20", new trsuperobject(20,25,20,"Dertli kişiye ezgi söylemek,Soğuk günde giysilerini üzerinden almaya,Ya da sodaya sirke katmaya benzer."));
trsuperobject.biblemap.put("b20_25_21", new trsuperobject(20,25,21,"Düşmanın acıkmışsa doyur,Susamışsa su ver."));
trsuperobject.biblemap.put("b20_25_22", new trsuperobject(20,25,22,"Bunu yapmakla onu utanca boğarsınVe RAB seni ödüllendirir."));
trsuperobject.biblemap.put("b20_25_23", new trsuperobject(20,25,23,"Kuzeyden esen rüzgar nasıl yağmur getirirse,İftiracı dil de öfkeli bakışlara yol açar."));
trsuperobject.biblemap.put("b20_25_24", new trsuperobject(20,25,24,"Kavgacı kadınla aynı evde oturmaktansa,Damın köşesinde oturmak yeğdir."));
trsuperobject.biblemap.put("b20_25_25", new trsuperobject(20,25,25,"Susamış kişi için soğuk su neyse,Uzak ülkeden gelen iyi haber de öyledir."));
trsuperobject.biblemap.put("b20_25_26", new trsuperobject(20,25,26,"Kötünün önünde pes eden doğru kişi,Suyu bulanmış pınar, kirlenmiş kuyu gibidir."));
trsuperobject.biblemap.put("b20_25_27", new trsuperobject(20,25,27,"Fazla bal yemek iyi değildir;Hep yüceltilmeyi beklemek de..."));
trsuperobject.biblemap.put("b20_25_28", new trsuperobject(20,25,28,"Kendini denetleyemeyen kişiYıkılmış sursuz kent gibidir."));
trsuperobject.biblemap.put("b20_26_1", new trsuperobject(20,26,1,"Yaz ortasında kar, hasatta yağmur uygun olmadığı gibi,Akılsıza da onur yakışmaz."));
trsuperobject.biblemap.put("b20_26_2", new trsuperobject(20,26,2,"Öteye beriye uçuşan serçeVe kırlangıç gibi,Hak edilmemiş lanet de tutmaz."));
trsuperobject.biblemap.put("b20_26_3", new trsuperobject(20,26,3,"Ata kırbaç, eşeğe gem,Akılsızın sırtına da değnek gerek."));
trsuperobject.biblemap.put("b20_26_4", new trsuperobject(20,26,4,"Akılsıza ahmaklığına göre karşılık verme,Yoksa sen de onun düzeyine inersin."));
trsuperobject.biblemap.put("b20_26_5", new trsuperobject(20,26,5,"Akılsıza ahmaklığına uygun karşılık ver,Yoksa kendini bilge sanır."));
trsuperobject.biblemap.put("b20_26_6", new trsuperobject(20,26,6,"Akılsızın eliyle haber gönderen,Kendi ayaklarını kesen biri gibi,Kendine zarar verir."));
trsuperobject.biblemap.put("b20_26_7", new trsuperobject(20,26,7,"Akılsızın ağzında özdeyiş,Kötürümün sarkan bacakları gibidir."));
trsuperobject.biblemap.put("b20_26_8", new trsuperobject(20,26,8,"Akılsızı onurlandırmak,Taşı sapana bağlamak gibidir."));
trsuperobject.biblemap.put("b20_26_9", new trsuperobject(20,26,9,"Sarhoşun elindeki dikenli dal ne ise,Akılsızın ağzında özdeyiş de odur."));
trsuperobject.biblemap.put("b20_26_10", new trsuperobject(20,26,10,"Oklarını gelişigüzel fırlatan okçu neyse,Yoldan geçen akılsızı ya da sarhoşu ücretle tutan da öyledir."));
trsuperobject.biblemap.put("b20_26_11", new trsuperobject(20,26,11,"Ahmaklığını tekrarlayan akılsız,Kusmuğuna dönen köpek gibidir."));
trsuperobject.biblemap.put("b20_26_12", new trsuperobject(20,26,12,"Kendini bilge gören birini tanıyor musun?Akılsız bile ondan daha umut vericidir."));
trsuperobject.biblemap.put("b20_26_13", new trsuperobject(20,26,13,"Tembel, ‹‹Yolda aslan var,Sokaklarda aslan dolaşıyor›› der."));
trsuperobject.biblemap.put("b20_26_14", new trsuperobject(20,26,14,"Menteşeleri üzerinde dönen kapı gibi,Tembel de yatağında döner durur."));
trsuperobject.biblemap.put("b20_26_15", new trsuperobject(20,26,15,"Tembel elini sahana daldırır,Yeniden ağzına götürmeye üşenir."));
trsuperobject.biblemap.put("b20_26_16", new trsuperobject(20,26,16,"Tembel kendini,Akıllıca yanıt veren yedi kişiden daha bilge sanır."));
trsuperobject.biblemap.put("b20_26_17", new trsuperobject(20,26,17,"Kendini ilgilendirmeyen bir kavgaya bulaşan kişi,Yoldan geçen köpeği kulaklarından tutana benzer."));
trsuperobject.biblemap.put("b20_26_18-19", new trsuperobject(20,26,18-19,"Ateşli ve öldürücü oklar savuran bir deli neyse,Komşusunu aldatıp, ‹‹Şaka yapıyordum››Diyen de öyledir."));
trsuperobject.biblemap.put("b20_26_20", new trsuperobject(20,26,20,"Odun bitince ateş söner,Dedikoducu yok olunca kavga diner."));
trsuperobject.biblemap.put("b20_26_21", new trsuperobject(20,26,21,"Kor için kömür, ateş için odun neyse,Çekişmeyi alevlendirmek için kavgacı da öyledir."));
trsuperobject.biblemap.put("b20_26_22", new trsuperobject(20,26,22,"Dedikodu tatlı lokma gibidir,İnsanın ta içine işler."));
trsuperobject.biblemap.put("b20_26_23", new trsuperobject(20,26,23,"Okşayıcı dudaklarla kötü yürek,Sırlanmış toprak kaba benzer."));
trsuperobject.biblemap.put("b20_26_24", new trsuperobject(20,26,24,"Yüreği nefret dolu kişi sözleriyle niyetini gizlemeye çalışır,Ama içi hile doludur."));
trsuperobject.biblemap.put("b20_26_25", new trsuperobject(20,26,25,"Güzel sözlerine kanma,Çünkü yüreğinde yedi iğrenç şey vardır."));
trsuperobject.biblemap.put("b20_26_26", new trsuperobject(20,26,26,"Nefretini hileyle örtse bile,Kötülüğü toplumun önünde ortaya çıkar."));
trsuperobject.biblemap.put("b20_26_27", new trsuperobject(20,26,27,"Başkasının kuyusunu kazan içine kendi düşer,Taşı yuvarlayan altında kalır."));
trsuperobject.biblemap.put("b20_26_28", new trsuperobject(20,26,28,"Yalancı dil incittiği kişilerden nefret eder,Yaltaklanan ağızdan yıkım gelir."));
trsuperobject.biblemap.put("b20_27_1", new trsuperobject(20,27,1,"Yarınla övünme,Çünkü ne getireceğini bilemezsin."));
trsuperobject.biblemap.put("b20_27_2", new trsuperobject(20,27,2,"Seni kendi ağzın değil, başkaları övsün,Kendi dudakların değil, yabancı övsün."));
trsuperobject.biblemap.put("b20_27_3", new trsuperobject(20,27,3,"Taş ağırdır, kum bir yüktür,Ama ahmağın kışkırtması ikisinden de ağırdır."));
trsuperobject.biblemap.put("b20_27_4", new trsuperobject(20,27,4,"Öfke zalim, hiddet azgındır,Ama kıskançlığa kim dayanabilir?"));
trsuperobject.biblemap.put("b20_27_5", new trsuperobject(20,27,5,"Açık bir azar,Gizli tutulan sevgiden iyidir."));
trsuperobject.biblemap.put("b20_27_6", new trsuperobject(20,27,6,"Düşmanın öpücükleri aldatıcıdır,Ama dostun seni iyiliğin için yaralar."));
trsuperobject.biblemap.put("b20_27_7", new trsuperobject(20,27,7,"Tok insanın canı balı bile çekmez,Aç kişiye en acı şey tatlı gelir."));
trsuperobject.biblemap.put("b20_27_8", new trsuperobject(20,27,8,"Yuvasından uzak kalan kuş nasılsa,Yurdundan uzak kalan insan da öyledir."));
trsuperobject.biblemap.put("b20_27_9", new trsuperobject(20,27,9,"Güzel koku ve buhur canı ferahlatır,Dostun verdiği öğüt insana tatlı gelir."));
trsuperobject.biblemap.put("b20_27_10", new trsuperobject(20,27,10,"Kendi dostunu da babanın dostunu da bırakmaVe felakete uğradığın gün kardeşinin evine gitme;Yakın komşun uzaktaki kardeşten yeğdir."));
trsuperobject.biblemap.put("b20_27_11", new trsuperobject(20,27,11,"Oğlum, bilgece davran ki yüreğim sevinsin,Beni ayıplayana yanıt vereyim."));
trsuperobject.biblemap.put("b20_27_12", new trsuperobject(20,27,12,"İhtiyatlı kişi tehlikeyi görünce saklanır,Bönse öne atılır ve zarar görür."));
trsuperobject.biblemap.put("b20_27_13", new trsuperobject(20,27,13,"Tanımadığı birine kefil olanın giysisini al;Bir yabancı için yapıyorsa bunu,Giysisini rehin tut."));
trsuperobject.biblemap.put("b20_27_14", new trsuperobject(20,27,14,"Sabah sabah komşuya verilen gürültülü bir selamKüfür sayılır."));
trsuperobject.biblemap.put("b20_27_15", new trsuperobject(20,27,15,"Kavgacı kadının dırdırıYağmurlu günde damlaların dinmeyen sesi gibidir."));
trsuperobject.biblemap.put("b20_27_16", new trsuperobject(20,27,16,"Böyle bir kadını dizginlemeye kalkmak,Rüzgarı ya da yağı avuçta tutmaya çalışmak gibidir."));
trsuperobject.biblemap.put("b20_27_17", new trsuperobject(20,27,17,"Demir demiri biler,İnsan da insanı..."));
trsuperobject.biblemap.put("b20_27_18", new trsuperobject(20,27,18,"İncir ağacını budayan meyvesini yer,Efendisine hizmet eden onurlandırılır."));
trsuperobject.biblemap.put("b20_27_19", new trsuperobject(20,27,19,"Su görüntümüzü nasıl yansıtıyorsa,Yürek de insanın içini yansıtır."));
trsuperobject.biblemap.put("b20_27_20", new trsuperobject(20,27,20,"Ölüm ve yıkım diyarı insana doymaz,İnsanın gözü de hiç doymaz."));
trsuperobject.biblemap.put("b20_27_21", new trsuperobject(20,27,21,"Altın ocakta, gümüş potada sınanır,İnsansa aldığı övgüyle sınanır."));
trsuperobject.biblemap.put("b20_27_22", new trsuperobject(20,27,22,"Ahmağı buğdayla birlikte dibekte tokmakla dövsen bile,Ahmaklığından kurtulmaz."));
trsuperobject.biblemap.put("b20_27_23", new trsuperobject(20,27,23,"Davarına iyi bak,Sığırlarına dikkat et."));
trsuperobject.biblemap.put("b20_27_24", new trsuperobject(20,27,24,"Çünkü zenginlik kalıcı değildirVe taç kuşaktan kuşağa geçmez."));
trsuperobject.biblemap.put("b20_27_25", new trsuperobject(20,27,25,"Çayır biçilince, yeni çimen çıkınca,Dağlardaki otlar toplanınca,"));
trsuperobject.biblemap.put("b20_27_26", new trsuperobject(20,27,26,"Kuzular seni giydirir,Tekeler tarlanın bedeli olur."));
trsuperobject.biblemap.put("b20_27_27", new trsuperobject(20,27,27,"Keçilerin sütü yalnız seni değil,Ev halkını, hizmetçilerini de doyurmaya yeter."));
trsuperobject.biblemap.put("b20_28_1", new trsuperobject(20,28,1,"Kötü kişi kendisini kovalayan olmasa bile kaçar,Doğrularsa genç aslan gibi yüreklidir."));
trsuperobject.biblemap.put("b20_28_2", new trsuperobject(20,28,2,"Ayaklanan ülke çok başlı olur,Ama akıllı, bilgili kişi düzeni sağlar."));
trsuperobject.biblemap.put("b20_28_3", new trsuperobject(20,28,3,"Yoksulu ezen yoksul,Ürünü harap eden sağanak yağmur gibidir."));
trsuperobject.biblemap.put("b20_28_4", new trsuperobject(20,28,4,"Yasayı terk eden kötüyü över,Yerine getirense kötüye karşı çıkar."));
trsuperobject.biblemap.put("b20_28_5", new trsuperobject(20,28,5,"Kötüler adaletten anlamaz,RABbe yönelenlerse her yönüyle anlar."));
trsuperobject.biblemap.put("b20_28_6", new trsuperobject(20,28,6,"Dürüst bir yoksul olmak,Yolsuzlukla zengin olmaktan yeğdir."));
trsuperobject.biblemap.put("b20_28_7", new trsuperobject(20,28,7,"Kutsal Yasayı yerine getiren çocuk akıllıdır,Oburlarla arkadaşlık edense babasını utandırır."));
trsuperobject.biblemap.put("b20_28_8", new trsuperobject(20,28,8,"Faiz ve tefecilikle malına mal katan kişi,Bunu yoksullara acıyan için biriktirir."));
trsuperobject.biblemap.put("b20_28_9", new trsuperobject(20,28,9,"Yasaya kulağını tıkayanınDuası da iğrençtir."));
trsuperobject.biblemap.put("b20_28_10", new trsuperobject(20,28,10,"Dürüst kişileri kötü yola saptıranKendi kazdığı çukura düşer.İyiliği, özü sözü bir olanlar miras alacak."));
trsuperobject.biblemap.put("b20_28_11", new trsuperobject(20,28,11,"Zengin kendini bilge sanır,Ama akıllı yoksul onun içini okur."));
trsuperobject.biblemap.put("b20_28_12", new trsuperobject(20,28,12,"Doğruların zaferi coşkuyla kutlanır,Ama kötüler egemen olunca insan kaçacak yer arar."));
trsuperobject.biblemap.put("b20_28_13", new trsuperobject(20,28,13,"Günahlarını gizleyen başarılı olmaz,İtiraf edip bırakansa merhamet bulur."));
trsuperobject.biblemap.put("b20_28_14", new trsuperobject(20,28,14,"Günahtan çekinen ne mutludur!İnatçılık edense belaya düşer."));
trsuperobject.biblemap.put("b20_28_15", new trsuperobject(20,28,15,"Yoksul halkı yöneten kötü kişiKükreyen aslan, saldırgan ayı gibidir."));
trsuperobject.biblemap.put("b20_28_16", new trsuperobject(20,28,16,"Gaddar önderin aklı kıttır;Haksız kazançtan nefret edense uzun ömürlü olur."));
trsuperobject.biblemap.put("b20_28_17", new trsuperobject(20,28,17,"Adam öldürmekten vicdan azabı çeken, mezara dek kaçacaktır;Kimse ona yardım etmesin."));
trsuperobject.biblemap.put("b20_28_18", new trsuperobject(20,28,18,"Alnı ak yaşayan kurtulur,Yolsuzluk yapan ansızın yıkıma uğrar."));
trsuperobject.biblemap.put("b20_28_19", new trsuperobject(20,28,19,"Toprağını işleyenin ekmeği bol olur,Hayal peşinde koşansa yoksulluğa doyar."));
trsuperobject.biblemap.put("b20_28_20", new trsuperobject(20,28,20,"Güvenilir kişi bolluğa erer,Zengin olmaya can atansa beladan kurtulamaz."));
trsuperobject.biblemap.put("b20_28_21", new trsuperobject(20,28,21,"Hatır gözetmek iyi değildir,Çünkü insan bir lokma ekmek için bile suç işler."));
trsuperobject.biblemap.put("b20_28_22", new trsuperobject(20,28,22,"Cimri servet peşinde koşar,Yoksulluğa uğrayacağını düşünmez."));
trsuperobject.biblemap.put("b20_28_23", new trsuperobject(20,28,23,"Başkasını azarlayan sonundaPohpohlayandan daha çok beğeni kazanır."));
trsuperobject.biblemap.put("b20_28_24", new trsuperobject(20,28,24,"Annesini ya da babasını soymayı günah saymayan,Haydutla birdir."));
trsuperobject.biblemap.put("b20_28_25", new trsuperobject(20,28,25,"Açgözlü kavga çıkarır,RABbe güvenense bolluk içinde yaşar."));
trsuperobject.biblemap.put("b20_28_26", new trsuperobject(20,28,26,"Kendine güvenen akılsızdır,Bilgece davranan güvenlikte olur."));
trsuperobject.biblemap.put("b20_28_27", new trsuperobject(20,28,27,"Yoksula verenin eksiği olmaz,Yoksulu görmezden gelense bir sürü lanete uğrar."));
trsuperobject.biblemap.put("b20_28_28", new trsuperobject(20,28,28,"Kötüler egemen olunca insan kaçacak yer arar,Ama kötüler yok olunca doğrular çoğalır."));
trsuperobject.biblemap.put("b20_29_1", new trsuperobject(20,29,1,"Defalarca azarlandığı halde dikbaşlılık eden,Ansızın yıkıma uğrayacak, çare yok."));
trsuperobject.biblemap.put("b20_29_2", new trsuperobject(20,29,2,"Doğru kişiler çoğalınca halk sevinir,Kötü kişi hükümdar olunca halk inler."));
trsuperobject.biblemap.put("b20_29_3", new trsuperobject(20,29,3,"Bilgeliği seven babasını sevindirir,Fahişelerle dostluk eden malını yitirir."));
trsuperobject.biblemap.put("b20_29_4", new trsuperobject(20,29,4,"Adaletle yöneten kral ülkesini ayakta tutar,Ağır vergiler koyansa çökertir."));
trsuperobject.biblemap.put("b20_29_5", new trsuperobject(20,29,5,"Başkasını pohpohlayan kişi,Ona tuzak kurar."));
trsuperobject.biblemap.put("b20_29_6", new trsuperobject(20,29,6,"Kötünün başkaldırısı kendine tuzak olur,Doğru kişiyse ezgi söyler ve sevinir."));
trsuperobject.biblemap.put("b20_29_7", new trsuperobject(20,29,7,"Doğru kişi yoksulların hakkını verir,Kötü kişi hak hukuk nedir bilmez."));
trsuperobject.biblemap.put("b20_29_8", new trsuperobject(20,29,8,"Alaycı kişiler kentleri bile karıştırır,Bilgelerse öfkeyi yatıştırır."));
trsuperobject.biblemap.put("b20_29_9", new trsuperobject(20,29,9,"Bilge kişiyle davası olan ahmakKızar, alay eder ve rahat vermez."));
trsuperobject.biblemap.put("b20_29_10", new trsuperobject(20,29,10,"Kana susamışlar dürüst kişiden nefret eder,Doğrularsa onun canını korur."));
trsuperobject.biblemap.put("b20_29_11", new trsuperobject(20,29,11,"Akılsız hep patlamaya hazırdır,Bilgeyse öfkesini dizginler."));
trsuperobject.biblemap.put("b20_29_12", new trsuperobject(20,29,12,"Hükümdar yalana kulak verirse,Bütün görevlileri de kötü olur."));
trsuperobject.biblemap.put("b20_29_13", new trsuperobject(20,29,13,"Zorbayla yoksulun ortak bir noktası var:İkisinin de gözünü açan RABdir."));
trsuperobject.biblemap.put("b20_29_14", new trsuperobject(20,29,14,"Yoksulları adaletle yöneten kralınTahtı hep güvenlikte olur."));
trsuperobject.biblemap.put("b20_29_15", new trsuperobject(20,29,15,"Değnekle terbiye bilgelik kazandırır,Kendi haline bırakılan çocuksa annesini utandırır."));
trsuperobject.biblemap.put("b20_29_16", new trsuperobject(20,29,16,"Kötüler çoğalınca başkaldırı da çoğalır,Ama doğrular onların düşüşünü görecektir."));
trsuperobject.biblemap.put("b20_29_17", new trsuperobject(20,29,17,"Oğlunu terbiye et, o da sana huzur verecekVe gönlünü hoşnut edecektir."));
trsuperobject.biblemap.put("b20_29_18", new trsuperobject(20,29,18,"Tanrısal esinden yoksun olan halkSınır tanımaz olur.Ne mutlu Kutsal Yasayı yerine getirene!"));
trsuperobject.biblemap.put("b20_29_19", new trsuperobject(20,29,19,"Köle salt sözle terbiye edilemez,Çünkü anlasa da kulak asmaz."));
trsuperobject.biblemap.put("b20_29_20", new trsuperobject(20,29,20,"Sözünü tartmadan konuşan birini tanıyor musun?Akılsızın durumu bile onunkinden daha umut vericidir."));
trsuperobject.biblemap.put("b20_29_21", new trsuperobject(20,29,21,"Çocukluğundan beri kölesini şımartan,Sonunda cezasını çeker."));
trsuperobject.biblemap.put("b20_29_22", new trsuperobject(20,29,22,"Öfkeli kişi çekişme yaratır,Huysuz kişinin başkaldırısı eksik olmaz."));
trsuperobject.biblemap.put("b20_29_23", new trsuperobject(20,29,23,"Kibir insanı küçük düşürür,Alçakgönüllülükse onur kazandırır."));
trsuperobject.biblemap.put("b20_29_24", new trsuperobject(20,29,24,"Hırsızla ortak olanın düşmanı kendisidir,Mahkemede yemin etse de bildiğini söylemez."));
trsuperobject.biblemap.put("b20_29_25", new trsuperobject(20,29,25,"İnsandan korkmak tuzaktır,Ama RABbe güvenen güvenlikte olur."));
trsuperobject.biblemap.put("b20_29_26", new trsuperobject(20,29,26,"Hükümdarın gözüne girmek isteyen çoktur,Ama RABdir insana adalet sağlayan."));
trsuperobject.biblemap.put("b20_29_27", new trsuperobject(20,29,27,"Doğrular haksızlardan iğrenir,Kötüler de dürüst yaşayanlardan."));
trsuperobject.biblemap.put("b20_30_1", new trsuperobject(20,30,1,"Massalı Yake oğlu Agurun sözleri:Bu adam şöyle diyor:‹‹Yoruldum, ey Tanrım, yoruldum ve tükendim. ve tükendim›› ya da ‹‹Bu adam İtiele, İtiele ve Ukkala şöyle diyor››."));
trsuperobject.biblemap.put("b20_30_2", new trsuperobject(20,30,2,"Gerçekten ben insanların en cahiliyim,Bende insan aklı yok."));
trsuperobject.biblemap.put("b20_30_3", new trsuperobject(20,30,3,"Bilgeliği öğrenmedim,Kutsal Olana ilişkin bilgiden de yoksunum."));
trsuperobject.biblemap.put("b20_30_4", new trsuperobject(20,30,4,"Kim göklere çıkıp indi?Kim yeli avuçlarında topladı?Suları giysisiyle sarıp sarmalayan kim?Kim belirledi dünyanın sınırlarını?Adı nedir, oğlunun adı nedir, biliyorsan söyle!"));
trsuperobject.biblemap.put("b20_30_5", new trsuperobject(20,30,5,"Tanrının her sözü güvenilirdir,O kendisine sığınan herkese kalkandır."));
trsuperobject.biblemap.put("b20_30_6", new trsuperobject(20,30,6,"Onun sözüne bir şey katma,Yoksa seni azarlar, yalancı çıkarsın."));
trsuperobject.biblemap.put("b20_30_7", new trsuperobject(20,30,7,"Ey Tanrı, iki şey diledim senden:Ben ölmeden bunları esirgeme benden."));
trsuperobject.biblemap.put("b20_30_8", new trsuperobject(20,30,8,"Sahtekârlığı, yalanı benden uzak tut,Bana ne yoksulluk ne de zenginlik ver;Payıma düşen ekmeği ver, yeter."));
trsuperobject.biblemap.put("b20_30_9", new trsuperobject(20,30,9,"Yoksa bolluktan, ‹Kimmiş RAB?› diye seni yadsır,Ya da yoksulluktan çalarVe Tanrımın adını lekelemiş olurum."));
trsuperobject.biblemap.put("b20_30_10", new trsuperobject(20,30,10,"‹‹Köleyi efendisine çekiştirme,Yoksa sana lanet eder, sen de suçlu çıkarsın."));
trsuperobject.biblemap.put("b20_30_11", new trsuperobject(20,30,11,"Öyleleri var ki, babalarına lanet eder,Annelerine değer vermezler."));
trsuperobject.biblemap.put("b20_30_12", new trsuperobject(20,30,12,"Öyleleri var ki, kendilerini tertemiz sanırlar,Oysa kötülüklerinden arınmış değiller."));
trsuperobject.biblemap.put("b20_30_13", new trsuperobject(20,30,13,"Öyleleri var ki, kendilerinden üstün kimse yok sanır,Herkese tepeden bakarlar."));
trsuperobject.biblemap.put("b20_30_14", new trsuperobject(20,30,14,"Öyleleri var ki, dişleri kılıç, çeneleri bıçaktır,Mazlumlarla yoksulları yutup yeryüzünden yok ederler."));
trsuperobject.biblemap.put("b20_30_15", new trsuperobject(20,30,15,"Sülüğün iki kızı vardır, adları ‹Ver, ver›dir.Hiç doymayan üç şey,‹Yeter› demeyen dört şey vardır:"));
trsuperobject.biblemap.put("b20_30_16", new trsuperobject(20,30,16,"Ölüler diyarı, kısır rahim,Suya doymayan toprak ve ‹Yeter› demeyen ateş."));
trsuperobject.biblemap.put("b20_30_17", new trsuperobject(20,30,17,"Babasıyla alay edenin, annesinin sözünü hor göreninGözünü vadideki kargalar oyacak;O akbabalara yem olacak."));
trsuperobject.biblemap.put("b20_30_18", new trsuperobject(20,30,18,"Aklımın ermediği üç şey,Anlamadığım dört şey var:"));
trsuperobject.biblemap.put("b20_30_19", new trsuperobject(20,30,19,"Kartalın gökyüzünde,Yılanın kayada,Geminin denizde izlediği yolVe erkeğin genç kızla tuttuğu yol."));
trsuperobject.biblemap.put("b20_30_20", new trsuperobject(20,30,20,"Zina eden kadının yolu da şöyledir:Yer, ağzını siler,Sonra da, ‹Suç işlemedim› der."));
trsuperobject.biblemap.put("b20_30_21", new trsuperobject(20,30,21,"Yeryüzü üç şeyin altında sarsılır;Katlanamadığı dört şey vardır:"));
trsuperobject.biblemap.put("b20_30_22", new trsuperobject(20,30,22,"Kölenin kral olması,Budalanın doyması,"));
trsuperobject.biblemap.put("b20_30_23", new trsuperobject(20,30,23,"Nefret edilen kadının evlenmesiVe hizmetçinin hanımının yerine geçmesi."));
trsuperobject.biblemap.put("b20_30_24", new trsuperobject(20,30,24,"‹‹Dünyada dört küçük yaratık var ki,Çok bilgece davranırlar:"));
trsuperobject.biblemap.put("b20_30_25", new trsuperobject(20,30,25,"Karıncalar güçlü olmayan bir topluluktur,Ama yiyeceklerini yazdan biriktirirler."));
trsuperobject.biblemap.put("b20_30_26", new trsuperobject(20,30,26,"Kaya tavşanları da güçsüz bir topluluktur,Ama yuvalarını kaya kovuklarında yaparlar."));
trsuperobject.biblemap.put("b20_30_27", new trsuperobject(20,30,27,"Çekirgelerin kralı yoktur,Ama bölük bölük ilerlerler."));
trsuperobject.biblemap.put("b20_30_28", new trsuperobject(20,30,28,"Kertenkele elle bile yakalanır,Ama kral saraylarında bulunur."));
trsuperobject.biblemap.put("b20_30_29", new trsuperobject(20,30,29,"‹‹Yürüyüşü gösterişli üç yaratık,Davranışı gösterişli dört yaratık var:"));
trsuperobject.biblemap.put("b20_30_30", new trsuperobject(20,30,30,"Hayvanların en güçlüsü olanVe hiçbir şeyin önünde pes etmeyen aslan,"));
trsuperobject.biblemap.put("b20_30_31", new trsuperobject(20,30,31,"Tazıfş, tekeVe ordusunun başındaki kral. sözcüğün anlamı tam bilinmiyor."));
trsuperobject.biblemap.put("b20_30_32", new trsuperobject(20,30,32,"‹‹Eğer budala gibi kendini yücelttinseYa da kötülük tasarladınsa,Dur ve düşün!"));
trsuperobject.biblemap.put("b20_30_33", new trsuperobject(20,30,33,"Çünkü nasıl sütü dövünce tereyağı,Burnu sıkınca kan çıkarsa,Öfkeyi kurcalayınca da kavga çıkar.››"));
trsuperobject.biblemap.put("b20_31_1", new trsuperobject(20,31,1,"Massa Kralı Lemuelin sözleri,Annesinin ona öğrettikleri:"));
trsuperobject.biblemap.put("b20_31_2", new trsuperobject(20,31,2,"‹‹Oğlum, rahmimin ürünü, ne diyeyim?Adaklarımın yanıtı oğlum, ne diyeyim?"));
trsuperobject.biblemap.put("b20_31_3", new trsuperobject(20,31,3,"Gücünü kadınlara,Gençliğini kralları mahvedenlere kaptırma!"));
trsuperobject.biblemap.put("b20_31_4", new trsuperobject(20,31,4,"‹‹Şarap içmek krallara yakışmaz, ey Lemuel,Krallara yakışmaz!İçkiyi özlemek hükümdarlara yaraşmaz."));
trsuperobject.biblemap.put("b20_31_5", new trsuperobject(20,31,5,"Çünkü içince kuralları unutur,Mazlumun hakkını yerler."));
trsuperobject.biblemap.put("b20_31_6", new trsuperobject(20,31,6,"İçkiyi çaresize,Şarabı kaygı çekene verin."));
trsuperobject.biblemap.put("b20_31_7", new trsuperobject(20,31,7,"İçsin ki yoksulluğunu unutsun,Artık sefaletini anmasın."));
trsuperobject.biblemap.put("b20_31_8", new trsuperobject(20,31,8,"Ağzını hakkını savunamayan için,Kimsesizin davasını gütmek için aç."));
trsuperobject.biblemap.put("b20_31_9", new trsuperobject(20,31,9,"Ağzını aç ve adaletle yargıla,Mazlumun, yoksulun hakkını savun.››"));
trsuperobject.biblemap.put("b20_31_10", new trsuperobject(20,31,10,"Erdemli kadını kim bulabilir?Onun değeri mücevherden çok üstündür. sırayla İbranice alfabenin değişik bir harfiyle başlar."));
trsuperobject.biblemap.put("b20_31_11", new trsuperobject(20,31,11,"Kocası ona yürekten güvenirVe kazancı eksilmez."));
trsuperobject.biblemap.put("b20_31_12", new trsuperobject(20,31,12,"Kadın ona kötülükle değil,Yaşamı boyunca iyilikle karşılık verir."));
trsuperobject.biblemap.put("b20_31_13", new trsuperobject(20,31,13,"Yün, keten bulur,Zevkle elleriyle işler."));
trsuperobject.biblemap.put("b20_31_14", new trsuperobject(20,31,14,"Ticaret gemileri gibidir,Yiyeceğini uzaktan getirir."));
trsuperobject.biblemap.put("b20_31_15", new trsuperobject(20,31,15,"Gün ağarmadan kalkar,Ev halkına yiyecek, hizmetçilerine paylarını verir."));
trsuperobject.biblemap.put("b20_31_16", new trsuperobject(20,31,16,"Bir tarlayı gözüne kestirip satın alır,El emeğiyle kazandığı parayla bağ diker."));
trsuperobject.biblemap.put("b20_31_17", new trsuperobject(20,31,17,"Giyinip kollarını sıvar,Canla başla çalışır."));
trsuperobject.biblemap.put("b20_31_18", new trsuperobject(20,31,18,"Ticaretinin kârlı olduğunu bilir,Çırası gece boyunca yanar."));
trsuperobject.biblemap.put("b20_31_19", new trsuperobject(20,31,19,"Eliyle örekeyi tutar,Avucunda iği tutar."));
trsuperobject.biblemap.put("b20_31_20", new trsuperobject(20,31,20,"Mazluma kollarını açar,Yoksula elini uzatır."));
trsuperobject.biblemap.put("b20_31_21", new trsuperobject(20,31,21,"Kar yağınca ev halkı için kaygılanmaz,Çünkü hepsinin iki katfü giysisi vardır."));
trsuperobject.biblemap.put("b20_31_22", new trsuperobject(20,31,22,"Yatak örtüleri dokur,Kendi giysileri ince mor ketendendir."));
trsuperobject.biblemap.put("b20_31_23", new trsuperobject(20,31,23,"Kocası ülkenin ileri gelenleriyle oturup kalkar,Kent kurulunda iyi tanınır."));
trsuperobject.biblemap.put("b20_31_24", new trsuperobject(20,31,24,"Kadın diktiği keten giysilerleÖrdüğü kuşakları tüccara satar."));
trsuperobject.biblemap.put("b20_31_25", new trsuperobject(20,31,25,"Güç ve onurla kuşanmıştır,Geleceğe güvenle bakar."));
trsuperobject.biblemap.put("b20_31_26", new trsuperobject(20,31,26,"Ağzından bilgelik akar,Dili iyilik öğütler."));
trsuperobject.biblemap.put("b20_31_27", new trsuperobject(20,31,27,"Ev halkının işlerini yönetir,Tembellik nedir bilmez."));
trsuperobject.biblemap.put("b20_31_28", new trsuperobject(20,31,28,"Çocukları önünde ayağa kalkıp onu kutlar,Kocası onu över."));
trsuperobject.biblemap.put("b20_31_29", new trsuperobject(20,31,29,"‹‹Soylu işler yapan çok kadın var,Ama sen hepsinden üstünsün›› der."));
trsuperobject.biblemap.put("b20_31_30", new trsuperobject(20,31,30,"Çekicilik aldatıcı, güzellik boştur;Ama RABbe saygılı kadın övülmeye layıktır."));
trsuperobject.biblemap.put("b20_31_31", new trsuperobject(20,31,31,"Ellerinin hak ettiğini verin kendisine,Yaptıkları için kent kurulunda övülsün."));

